INSERT INTO `p8_cms_item_article_addon` VALUES ('2144','2964','1','','','为了进一步加强医院行风建设，优化医疗服务，盐城市一院监察室、护理部于2014年9月12日组织召开三季度工休座谈会。总务科、财务科、药剂科、医改办、设备科、物管办等行政职能科室负责人及外科病区的28名患者（家属）代表，应邀出席了会议。医院监察室主任殷葵同志首先','192.168.162.110','192.168.162.110','1410451200','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了进一步加强医院行风建设，优化医疗服务，盐城市一院监察室、护理部于2014年9月12日组织召开三季度工休座谈会。总务科、财务科、药剂科、医改办、设备科、物管办等行政职能科室负责人及外科病区的28名患者（家属）代表，应邀出席了会议。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">医院监察室主任殷葵同志首先向出席会议的病员及家属代表介绍了医院的基本情况。并指出，工休座谈会有利于加强医患沟通，促进建立长效管理机制，改进医疗服务，提高患者满意度。对患者及家属提出的意见和建议，将采取积极措施认真加以改进。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">会上，患者及家属代表对医院召开工休会，征求意见、解决问题的做法给予充分的肯定，对医护人员精心的治疗、细致的护理和周到的服务给予充分的肯定和高度赞扬。普外科一病区病员家属表扬徐立群主任婉拒“红包”，医术精湛；产科王坚青主任态度亲切，技术过硬；输血科何啸主任亲自到血站为重病患取血；谷波、刁永力、王书军、项群、曹正春、万政强主任心系患者，查房细心、解释耐心；护士长季丹、王跃琴、秦玲、黄建英、戴红萍；护士周建、刘莹、徐燕、谢悦馨、徐海燕护理到位、服务暖心；患者及家属还热情表扬了各病区的护理人员，她们像亲人一样关心呵护，细心照顾患者，不怕脏，不怕累，患者发生病情变化时，护士寸步不离、日夜守候，积极挽救患者生命。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">患者（家属）还点名表扬了仇兰华、薛国秀、刘云、沈宏琴等保洁员工。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">与会代表提出了12个条意见和建议，相关科室负责人作了现场解答。对需要进一步调查、核实的问题，以及需多科室、部门协调解决的问题，监察室在会后进行梳理汇总，下发书面通知到相关科室，要求整改并在一周内向建议人反馈。监察室将在近期对落实情况进行回查。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">最后，殷葵主任向各位患者（家属）代表诚恳致谢，座谈会在融洽、和谐的氛围中结束。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">　　</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2145','2965','1','','','为了更好地了解患者的需求，提升医疗服务水平，2013年12月31日，盐城市一院在门诊八楼会议室由纪委监察室、护理部组织召开了四季度工休座谈会。来自内科各病区的29名患者（家属）代表，纪委监察室、护理部、总务科、财务科、药剂科、医改办、设备科、物管办等行政职能科','192.168.162.110','192.168.162.110','1388419200','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了更好地了解患者的需求，提升医疗服务水平，2013年12月31日，盐城市一院在门诊八楼会议室由纪委监察室、护理部组织召开了四季度工休座谈会。来自内科各病区的29名患者（家属）代表，纪委监察室、护理部、总务科、财务科、药剂科、医改办、设备科、物管办等行政职能科室负责人应邀出席了会议。医院纪委书记于洪蔚同志到场作了讲话。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">于书记首先向与会人员介绍了医院的发展史及现状，并强调：座谈会有利于加强医患沟通，促进医院建立医疗服务长效管理机制。我院将继续在医疗质量、服务水平、行业作风、就医环境等方面大功夫，对患者及家属的意见和建议，将采取积极措施，认真加以改进，为构建和谐的医患关系，建设高水平的三甲医院继续扎实做好各项工作。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">座谈会在轻松愉悦的氛围下进行，患者及家属对医院召开工休会，征求患方意见、解决存在问题的做法给予了充分肯定。内分泌科一病区17床患者家属介绍，他姐夫身患糖尿病、脑梗等多种疾患，病情复杂、危重，三次住院都是市一院医护人员积极抢救，救回患者性命。患者性格暴躁，有时还会动手打人，但护士们从不计较，服务细致入微；任向东主任、武建霞护士长关怀备至、嘘寒问暖，让他全家都深深地感受到来自医务人员的温暖关爱。肿瘤科刘红旗主任拒收“红包”，护士吴晓丹服务耐心细致，康复医学科全体医护人员想患者所想，对患者关心体贴、照顾有加；姜永前、徐浩、董剑明、周成英、吴以连、卞伟刚、许强、陈卫伟、吴静等医生医术精湛、医德高尚，护士长沈小兰、牛丽姝、曹燕、杨剑病区管理井井有条，护理服务贴心温馨，感人事例，不胜枚举……。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">与会的职能科室负责人认真聆听了患者及家属对医疗、护理、后勤服务等方面提出的宝贵意见和建议，对部分问题进行了现场解答。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">座谈会在融洽、和谐的氛围中结束。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">　　</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2146','2966','1','','','为了更好地了解患者的需求，提升医疗服务水平，推进“三好一满意”活动深入开展， 2013年9月12日，盐城市一院在老干部病房楼十二楼会议室召开了三季度工休座谈会。来自医院外科各病区的24名患者及家属代表及医院总务科、财务科、药剂科、医改办、设备科、物管办等行政职','192.168.162.110','192.168.162.110','1379001600','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了更好地了解患者的需求，提升医疗服务水平，推进“三好一满意”活动深入开展， 2013年9月12日，盐城市一院在老干部病房楼十二楼会议室召开了三季度工休座谈会。来自医院外科各病区的24名患者及家属代表及医院总务科、财务科、药剂科、医改办、设备科、物管办等行政职能科室负责人应邀出席了会议。会议由医院纪委书记于洪蔚同志主持。</span><br /></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">于书记首先向与会人员介绍了医院的发展史及现状，并强调：座谈会有利于加强医患沟通，提高医院管理水平，促进医院长效管理机制的形成，促进医患和谐；对反映医院业务发展中需要改进的合理化建议，我们要认真深思和借鉴。今后，我院将继续在提高改善医疗质量、服务水平、行业作风、就医环境等方面要狠下功夫，对患者及家属的意见和建——将采取积极措施，认真加以改进，为构建和谐的医患关系，建设高水平的三甲医院继续扎实做好各项工作。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">座谈会在轻松愉悦的氛围下进行，患者及家属对医院召开工休会，征求患方意见、解决存在问题的做法给予了充分肯定。骨科一病区家属反映，其母亲在我院住院两次，住院期间，深切地感受到医务人员服务好、技术精，待病人如亲人；普通外科二病区患者家属认为全体护士服务细致、耐心，对病人关心，对工作尽心，通过优质的服务，体现出医护人员强烈的事业责任心。于书记认真聆听了患者及家属对医疗、护理、后勤服务等方面提出的宝贵意见和建议，对部分问题进行了现场解答。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">座谈会在融洽、和谐的氛围中结束。于书记表示，医院今后将会通过更多的方法和渠道，广泛征求和收集患者意见和建议，以此不断改善医疗服务，进行持续改进，构建和谐的医患关系，为人民的健康事业作出更大的贡献。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">　　</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2147','2967','1','','','为了进一步加强医院行风建设，推进“三好一满意”活动深入开展，提升医疗服务水平，深化医院“生命所系、健康相托”优质服务品牌内涵，市一院监察室、护理部于2013年7月25日组织召开了二季度病员工休座谈会。内科病区病员（家属）代表29人及医院总务科、财务科、药剂科','192.168.162.110','192.168.162.110','1374681600','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了进一步加强医院行风建设，推进“三好一满意”活动深入开展，提升医疗服务水平，深化医院“生命所系、健康相托”优质服务品牌内涵，市一院监察室、护理部于2013年7月25日组织召开了二季度病员工休座谈会。内科病区病员（家属）代表29人及医院总务科、财务科、药剂科、医改办、设备科、物管办等行政职能科室负责人应邀出席了会议，会议由院纪委书记于洪蔚同志主持。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">多年以来我院坚持通过多种途径，广泛收集社会群众的意见和建议。医院每季度、各病区每月召开一次工休会，通过面对面交流, 搭建了医患双方有效沟通的平台，及时了解患者诉求，查找整改存在问题，持续改进医疗服务，增进了医患之间的理解与信任。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">于书记首先向与会人员介绍了医院的发展史及现状，并指出，随着人们健康意识、维权意识的不断增强，群众就医时不仅着眼于医院技术水平和设备设施，对医疗服务的要求也不断提高。由于多种复杂的社会因素，医患关系变得更加复杂。作为院方，要不断更新服务理念，改进服务方式，以适应人民群众不断增长的健康需求。他要求与会各科室、部门要认真倾听患者及家属代表的意见，查找存在问题，积极落实整改。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">与会代表结合自己或家属的就医经历谈了具体的感受，肯定了近年来我院在加强行风建设、提高医疗水平、改善医疗服务等方面所取得的成绩。他们认为，医院服务态度的改善、服务设施的完善、服务水平的提升让越来越多的患者感受到温暖，也提高了社会对医院的信任度。座谈会上，患者（家属）对医院服务提出了23条意见和建议。针对提出的部分问题，相关科室负责人现场给予了解答，另有需要进一步调查、核实的问题，由相关科室带回，调查后尽快给患者答复。对于需各病区协调解决的问题，院监察室已于次日发出整改通知，各科室（病区）均提交了书面形式的整改措施并已及时向建议人解释、反馈措施落实情况。同时，他们也对医疗服务中存在的不足提出了建议与意见。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">工休会上，就患者及家属提出的问题，相关科室负责人进行了现场解答。对需要进一步调查、核实的问题，各科室明确表示将在调查后尽快给予明确答复。对于需多科室、部门协调解决的问题，监察室在会后进行梳理汇总，下发书面通知到相关科室，要求整改并在一周内向建议人反馈。监察室将在近期对措施落实情况进行回查。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">最后，于书记向各位患者（家属）代表诚恳致谢，座谈会在融洽、和谐的氛围中结束。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">　　</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2148','2968','1','','','为了加强医院行风建设，提高医疗服务水平，推进“三好一满意”活动，深化“生命所系、健康相托”优质服务品牌，医院纪委、监察室、护理部于2013年03月08日组织召开了本年度第一季度工休座谈会。会议由院纪委书记于洪蔚同志主持，设备科、总务科、财务科、药剂科、医改办','192.168.162.110','192.168.162.110','1362672000','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了加强医院行风建设，提高医疗服务水平，推进“三好一满意”活动，深化“生命所系、健康相托”优质服务品牌，医院纪委、监察室、护理部于2013年03月08日组织召开了本年度第一季度工休座谈会。会议由院纪委书记于洪蔚同志主持，设备科、总务科、财务科、药剂科、医改办、物管办、医务科等行政职能科室相关负责人及外科片住院病员（家属）代表等共计20人应邀出席了会议。会议上，于书记首先向与会人员介绍了医院的发展史及现状，并指出随着人们生活水平的不断提高，健康意识的不断增强，群众就医时不仅注重医院的硬件设施，对我们的服务也提出了更高的要求。同时，由于媒体、网络的普及，医药卫生相关法律法规的不健全，经济发展的制约等因素致使医患关系紧张，医疗纠纷的数量也呈不断上升的趋势。这一切都要求我们不断找出医疗服务中存在的各种缺陷，更新服务理念，改进服务方式，以适应新形势下人民群众的健康需求。会上，病员和（或）家属代表们均踊跃发言，就在此次就医过程中遇到的一些现象及亲身经历，肯定了我院在医疗水平、行风建设、医疗服务方面所取得的成绩，同时也指出了存在的问题，给出了相关的意见和建议。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">会议上，针对病员提出的部分问题，各相关科室负责人现场给予了解答，另有需要进一步调查、核实的问题，由各科室带回，调查后尽快给患者答复。对于需各病区协调、解决的问题，由监察室近日内发出整改通知，各科室（病区）限期提交书面形式的整改措施并及时反馈措施落实情况。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">会议最后，于书记向各位病员代表诚恳致谢，并希望大家能体谅医院的难处、医护人员的难处，帮助医院做好宣传工作，使得医院能够更好、更快的发展，为盐阜人民能多做贡献。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">　　</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">　　</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2149','2969','1','','http://www1.ycsyy.com/upload/images/2019/10/s_e39dcccf51295e83.JPG','为传承和弘扬中华优秀传统文化，培育和实践社会主义核心价值观，引导人民群众特别是青年一代树立正确的婚恋观、家庭观，推动家庭家庭和睦、社会和谐，我院团委于8月17日下午在青年职工中开展了以“我们的节日•七夕”为主题的经典诵读活动。本次活动共有二十多位我院的','192.168.162.110','192.168.162.110','1534435200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为传承和弘扬中华优秀传统文化，培育和实践社会主义核心价值观，引导人民群众特别是青年一代树立正确的婚恋观、家庭观，推动家庭家庭和睦、社会和谐，我院团委于8月17日下午在青年职工中开展了以“我们的节日•七夕”为主题的经典诵读活动。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">本次活动共有二十多位我院的青年报名参与，参赛选手围绕“爱情忠贞、家庭和睦、社会和谐”的主题，或分享名人的爱情故事，或抒发对美好生活的向往、或歌颂热爱生活的情怀等。他们声情并茂、抑扬顿挫的吟诵给大家带来了一场难得的视听盛宴，让大家充分感受到了中华优秀传统道德文化的力量，心灵得到了洗礼和升华。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">通过本次活动充分挖掘了“七夕节”的优秀文化内涵，凸显七夕爱情忠贞、家庭幸福等文化内涵，引导青年职工认知传统、尊重传统、继承传统、弘扬传统，促进现代家庭观念的健康成长 。</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/e39dcccf51295e83.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_e39dcccf51295e83.JPG\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/b499b5a2bacc344a.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_b499b5a2bacc344a.JPG\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2150','2970','1','','http://www1.ycsyy.com/upload/images/2019/10/s_a80beb029605d4e3.JPG','7月31日下午由团委负责人宋愚同志召集我院团干部进行例会，分管院长李奇志同志参加了例会。会上大家共同学习了共青团第十八次全国代表大会会议精神，并且对团的上半年工作进行了总结，下半年工作进行了部署。会议还布置了一项主要工作，就是近期要进行团支部书记的双述','192.168.162.110','192.168.162.110','1532966400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">7月31日下午由团委负责人宋愚同志召集我院团干部进行例会，分管院长李奇志同志参加了例会。会上大家共同学习了共青团第十八次全国代表大会会议精神，并且对团的上半年工作进行了总结，下半年工作进行了部署。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">会议还布置了一项主要工作，就是近期要进行团支部书记的双述双评工作，团委负责人宋愚同志就这项工作进行了具体布置，要求各位团干部认真对待，圆满完成这项工作。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">最后，李院长就团委的工作和医院的大局发展，对各位团干部提了具体要求，要求团干部要带领医院团员青年全面贯彻落实习近平新时代社会主义思想和十九大精神，在政治建设方面下功夫，以习近平新时代社会主义思想作为指引，在党委的领导下认真学习，争当学懂、弄通、做实的排头兵。</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/a80beb029605d4e3.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_a80beb029605d4e3.JPG\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/4e0554004824c7fa.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_4e0554004824c7fa.JPG\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2151','2971','1','','http://www1.ycsyy.com/upload/images/2019/10/s_23cac0be7defb844.JPG','5月8日下午,为纪念五一二国际护士节，首届护士节趣味运动会在江苏医药职业学院操场隆重举行。运动会由护理部主办, 工会、团委、妇委会协办，医院党委副书记、副院长朱向军致辞，党委书记、院长李大林宣布比赛开幕。本次运动会吸引了全院102个护理单元，413名选手的积极','192.168.162.110','192.168.162.110','1525708800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">5月8日下午,为纪念五一二国际护士节，首届护士节趣味运动会在江苏医药职业学院操场隆重举行。运动会由护理部主办, 工会、团委、妇委会协办，医院党委副书记、副院长朱向军致辞，党委书记、院长李大林宣布比赛开幕。本次运动会吸引了全院102个护理单元，413名选手的积极参与。运动会共设四个项目，指压板跳绳、袋鼠接力跳、无敌风火轮、拔河。运动员们个个精神抖擞，奋发向上，活动现场气氛活跃。最后，消毒供应中心获得无敌风火轮一等奖，手术室获得袋鼠接力跳一等奖，骨科南区一病区的李娜获得指压板跳绳一等奖，门急诊片获得三方拔河冠军。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">本次运动会本着&quot;友谊第一,比赛第二、重在参与&quot;的精神,在运动中收获快乐,在合作中体现团结,增进科室间友谊,促进和谐的医院文化氛围。这次活动不仅体现了市一院护理人员积极向上的精神风貌，又增强了团队凝聚力,使大家在紧张的工作之余得到放松,体验到运动的快乐。</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/23cac0be7defb844.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_23cac0be7defb844.JPG\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/3b0d4de5ef948a3f.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_3b0d4de5ef948a3f.JPG\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2152','2972','1','','http://www1.ycsyy.com/upload/images/2019/10/s_f7ac7e5ba200e074.JPG','4月27日和4月28日，我院团委分别在北区和南区开展了盐城市一院第七届届青年职工读书节活动。在院党委的关怀下，在全院各党支部大力支持下，在院团委的精心组织下，广大党团员青年和全院职工纷纷参与到活动来，选书、评书、购书，热闹非凡，共同延续了我院“春日读书”的','192.168.162.110','192.168.162.110','1524758400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">4月27日和4月28日，我院团委分别在北区和南区开展了盐城市一院第七届届青年职工读书节活动。在院党委的关怀下，在全院各党支部大力支持下，在院团委的精心组织下，广大党团员青年和全院职工纷纷参与到活动来，选书、评书、购书，热闹非凡，共同延续了我院“春日读书”的优良文化传统。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">此次读书节活动，丰富青年员工的文化生活，打造医院文化特色品牌，营造医院文化内涵氛围，鼓励青年员工多读书，读好书，引导青年员工明责任、强素质、比服务，讲奉献，全面提高青年的思想道德水平和文化素养，为医院的建设高水平的区域医疗中心和快速发展贡献青春和智慧。</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/f7ac7e5ba200e074.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_f7ac7e5ba200e074.JPG\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/57e41efa857ed159.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_57e41efa857ed159.JPG\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2153','2973','1','','http://www1.ycsyy.com/upload/images/2019/10/s_bbb53a64bbd03333.jpg','为更好地服务机关单身青年，本着关心青年、服务青年、凝聚青年，为青年排忧解难的宗旨，11月11日，盐城市委市级机关工委、团市委、市妇联在大丰区七彩花田联合举办“美丽青春·让爱成真”第六届盐城市直机关单身青年联谊会。我院积极组织本院30多名单身青年参加了此次联','192.168.162.110','192.168.162.110','1510416000','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为更好地服务机关单身青年，本着关心青年、服务青年、凝聚青年，为青年排忧解难的宗旨，11月11日，盐城市委市级机关工委、团市委、市妇联在大丰区七彩花田联合举办“美丽青春·让爱成真”第六届盐城市直机关单身青年联谊会。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">我院积极组织本院30多名单身青年参加了此次联谊会，与来自市直50多家单位的近200名单身青年朋友相聚一起，共度了美好时光。据悉，主办方积极为机关青年办实事、办好事，破解青年难题，已连续六年举办“市直机关单身青年联谊会”，为广大青年朋友提供一个展示自我、交流情感、缔结友谊、寻觅知音的平台和桥梁，“美丽青春让爱成真”市直机关单身青年联谊会品牌已经获得广大青年的充分认可。</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/bbb53a64bbd03333.jpg\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_bbb53a64bbd03333.jpg\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/f1de1f3615cfbdef.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_f1de1f3615cfbdef.JPG\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2154','2974','1','','http://www1.ycsyy.com/upload/images/2019/10/s_fa858f4a15b1050f.JPG','为迎接党的十九大胜利召开，进一步团结引领我院广大青年职工听党话、跟党走，以奋发向上的精神状态，弘扬“敬佑生命，救死扶伤，甘于奉献，大爱无疆”的新时期医疗卫生职业精神。近日，我院成功举办了“喜迎十九大、争创新业绩”演讲比赛。比赛在我院北区举行，共有32位','192.168.162.110','192.168.162.110','1506614400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为迎接党的十九大胜利召开，进一步团结引领我院广大青年职工听党话、跟党走，以奋发向上的精神状态，弘扬“敬佑生命，救死扶伤，甘于奉献，大爱无疆”的新时期医疗卫生职业精神。近日，我院成功举办了“喜迎十九大、争创新业绩”演讲比赛。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">比赛在我院北区举行，共有32位选手参加了此次比赛。经过激烈角逐和评委公平评判，比赛产生一等奖2名，二等奖3名，三等奖5名。此次比赛的优秀选手，还将被选派参加市卫计委组织的演讲比赛。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">此次“喜迎十九大，争创新业绩”演讲比赛，是我院迎接党的十九大胜利召开系列活动的一项重要内容，也是我院团组织开展“一学一做”教育实践的一堂生动团课，同时也给青年职工们一个抒发爱党爱国情怀，展现自我风采的平台，为迎接党的十九大的胜利召开营造了良好的氛围，引导广大青年职工以实际行动和优异业绩向党的十九大献礼！</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/fa858f4a15b1050f.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_fa858f4a15b1050f.JPG\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/aa35618bd5ab09b8.JPG\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_aa35618bd5ab09b8.JPG\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2155','2975','1','','http://www1.ycsyy.com/upload/images/2019/10/s_5d1b7e03920816c4.jpg','为贯彻团中央关于一学一做的学习要求，进一步加强团员的政治思想观念，增强团员对团组织的深刻认识，提高团员对团的相关知识的了解，我院团委组织部分团员代表开展了一次“怎样做一名合格团员”为主题的团课活动。会上，团委老师向大家讲解了合格团员的标准，如何在本职','192.168.162.110','192.168.162.110','1494432000','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为贯彻团中央关于一学一做的学习要求，进一步加强团员的政治思想观念，增强团员对团组织的深刻认识，提高团员对团的相关知识的了解，我院团委组织部分团员代表开展了一次“怎样做一名合格团员”为主题的团课活动。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">会上，团委老师向大家讲解了合格团员的标准，如何在本职工作中发挥自己优秀团员的作用。随后，大家踊跃发言，就如何建设共青团，履行团员职责发表自己的意见。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">团课结束后，青年团员们纷纷反映，通过此次团课学习，对共青团有了更为全面更为深刻的认识，并坚决拥护共产党的领导，遵守团员章程，认真履行团员的义务，努力学习争做一名优秀的共青团员。</span></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/5d1b7e03920816c4.jpg\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_5d1b7e03920816c4.jpg\" border=\"0\" /></a><a href=\"http://www1.ycsyy.com/upload/images/2019/10/a3b9f8631d3189b4.jpg\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_a3b9f8631d3189b4.jpg\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2156','2976','1','','http://www1.ycsyy.com/upload/images/2019/10/s_5c3404961b179c67.jpg','为了号召更多的青年多读书，读好书，4月20日和21日，我院团委先后在北院区、南院区开展了第六届“青年读书节”系列活动。让医院青年以读书节为契机，号召大家养成读书的好习惯，让更多的优秀青年加入到读书的行列中来，以此提高自己的文化修养，提升自己的人格魅力。举','192.168.162.110','192.168.162.110','1492876800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了号召更多的青年多读书，读好书，4月20日和21日，我院团委先后在北院区、南院区开展了第六届“青年读书节”系列活动。让医院青年以读书节为契机，号召大家养成读书的好习惯，让更多的优秀青年加入到读书的行列中来，以此提高自己的文化修养，提升自己的人格魅力。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">举办此次活动，旨在丰富我院内涵文化，倡导文明健康生活方式，培养青年读书兴趣和阅读习惯，提高青年思想道德水平，增强人文素养和服务意识，以读书为主线，打造书香医院。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/5c3404961b179c67.jpg\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_5c3404961b179c67.jpg\" border=\"0\" /></a></span><a href=\"http://www1.ycsyy.com/upload/images/2019/10/8d9ca30b7d224919.jpg\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_8d9ca30b7d224919.jpg\" border=\"0\" /></a></p><p style=\"text-align: center;\"><a href=\"http://www1.ycsyy.com/upload/images/2019/10/713a9592951d30d.jpg\" target=\"_blank\"><img src=\"http://www1.ycsyy.com/upload/images/2019/10/s_713a9592951d30d.jpg\" border=\"0\" /></a></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2157','2977','1','','http://www1.ycsyy.com/upload/images/2019/11/s_bf410418851afe7a.png','7月10日和7月11日，我院团委组织全院职工在北区和南区开展无偿献血活动。一大早，无偿献血车刚在门诊楼前停稳，就有职工在献血登记处进行填表、体检。他们有穿着工作服前来献血的，有刚下夜班的，也有休息专程赶回医院的。他们有医生、有护士，有行政人员，还有保安、保','192.168.162.110','192.168.162.110','1562688000','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">7月10日和7月11日，我院团委组织全院职工在北区和南区开展无偿献血活动。一大早，无偿献血车刚在门诊楼前停稳，就有职工在献血登记处进行填表、体检。他们有穿着工作服前来献血的，有刚下夜班的，也有休息专程赶回医院的。他们有医生、有护士，有行政人员，还有保安、保洁人员等。经体检、初筛合格后，大家纷纷伸手捋袖，献出殷红的鲜血。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">此次无偿献血活动，累计共有40余人参加，献血总量10000余毫升。我院此次的无偿献血活动，向广大市民传达了正能量，再次用实际行动，展示了白衣天使的风采，谱写了爱的赞歌。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_bf410418851afe7a.png\" border=\"0\" width=\"316\" height=\"301\" style=\"width: 316px; height: 301px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_557db37872ccdf40.JPG\" border=\"0\" width=\"355\" height=\"301\" style=\"width: 355px; height: 301px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_44295805f657d084.jpg\" border=\"0\" width=\"326\" height=\"302\" style=\"width: 326px; height: 302px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b4107886da8aaf08.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/4af5a9e2dab5690c.png\" title=\"image.png\" alt=\"image.png\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2158','2978','1','','http://www1.ycsyy.com/upload/images/2019/11/s_b9cf79d509ba7ed7.jpg','3月30日，盐城市第一人民医院内分泌科联合营养科在门诊大厅举办了“儿童矮小症义诊活动”。近百余人数参加了此次义诊，内分泌科刘艳梅、郝兰香主任医师在义诊前为各位患儿家长及患者讲解了矮小症相关科普知识。营养科高红兰主任也为参加义诊的患者讲解儿童日常营养的知','192.168.162.110','192.168.162.110','1553875200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">3月30日，盐城市第一人民医院内分泌科联合营养科在门诊大厅举办了“儿童矮小症义诊活动”。近百余人数参加了此次义诊，内分泌科刘艳梅、郝兰香主任医师在义诊前为各位患儿家长及患者讲解了矮小症相关科普知识。营养科高红兰主任也为参加义诊的患者讲解儿童日常营养的知识，此次活动免收专家挂号费及部分骨龄检测费。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_b9cf79d509ba7ed7.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_e7bd96db250a76b9.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_e587beb179d9ac6a.jpg\" border=\"0\" width=\"430\" height=\"438\" style=\"width: 430px; height: 438px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_e60fa5c503bfe67a.jpg\" border=\"0\" width=\"428\" height=\"436\" style=\"width: 428px; height: 436px;\" /></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2159','2979','1','','http://www1.ycsyy.com/upload/images/2019/11/s_19e9ec67740aa1d9.jpg','为感谢这群在我们身边无私奉献和辛勤付出的“城市美容师”，切实提高广大妇女同胞对子宫颈癌和乳腺癌的病因预防及早诊早治的意识，3月8日上午，盐城市一院“为了姐妹们的健康与幸福”—— 关爱“城市美容师”公益活动在市一院南区正式启动，我院组织了妇科、普外科的专','192.168.162.110','192.168.162.110','1551974400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为感谢这群在我们身边无私奉献和辛勤付出的“城市美容师”，切实提高广大妇女同胞对子宫颈癌和乳腺癌的病因预防及早诊早治的意识，3月8日上午，盐城市一院“为了姐妹们的健康与幸福”—— 关爱“城市美容师”公益活动在市一院南区正式启动，我院组织了妇科、普外科的专家十余人为盐城市区100名环卫女工提供免费、专业的健康服务。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_19e9ec67740aa1d9.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_22b366b4f118fc09.jpg\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2160','2980','1','','http://www1.ycsyy.com/upload/images/2019/11/s_8e5e0d02174a00b6.JPG','为积极培育和践行社会主义核心价值观，传播志愿服务理念，以传承和弘扬雷锋精神为主题，以纪念第20个“中国青年志愿者服务日”为契机，进一步推动我院志愿服务不断发展。我院3月5日上午在南、北院区门诊大厅举行义诊，组织来自普外科、内分泌科、肿瘤科、妇产科专家在为','192.168.162.110','192.168.162.110','1551715200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为积极培育和践行社会主义核心价值观，传播志愿服务理念，以传承和弘扬雷锋精神为主题，以纪念第20个“中国青年志愿者服务日”为契机，进一步推动我院志愿服务不断发展。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">我院3月5日上午在南、北院区门诊大厅举行义诊，组织来自普外科、内分泌科、肿瘤科、妇产科专家在为患者进行免费健康咨询服务，并给患者免费测量血压和血糖。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">3月5日上午，我院累计义诊500余人次，在社会上产生了良好的反响，得到了社会各界的广泛好评。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_8e5e0d02174a00b6.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_d5bc43554179ae4d.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_d624a64c29387dee.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_99732344dfc1fbcc.jpg\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2161','2981','1','','http://www1.ycsyy.com/upload/images/2019/11/s_235a3937a75e1ef.JPG','为了做好第20个“全国青年志愿者服务日”的宣传纪念活动，弘扬“奉献、友爱、互助、进步”的志愿服务精神，为完善社会服务、促进社会主义精神文明建设，3月5日下午我院与越河路社区联合开展了为社区居民义诊的活动。3月5日下午，我院神经内科的医生和护士，来到越河路社','192.168.162.110','192.168.162.110','1551715200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了做好第20个“全国青年志愿者服务日”的宣传纪念活动，弘扬“奉献、友爱、互助、进步”的志愿服务精神，为完善社会服务、促进社会主义精神文明建设，3月5日下午我院与越河路社区联合开展了为社区居民义诊的活动。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">3月5日下午，我院神经内科的医生和护士，来到越河路社区，为社区群众进行义诊和健康咨询，并为他们免费测量血压。志愿者们还走进行动不便和困难户家长为他们上门服务，受到社区群众的广泛好评。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_235a3937a75e1ef.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_c2857b91a5c07ed3.JPG\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2162','2982','1','','http://www1.ycsyy.com/upload/images/2019/11/s_2921fad9f685a704.JPG','5月9日，为了迎接“5.12”国际护士节，贯彻落实中央、省、市委关于加强社区建设的部署要求，我院同时组织南北院区医疗护理专家志愿者三十多人分别来到越河路社区和东晋社区，开展主题为“健康中国，科普助力”2018年庆祝国际护士节科普周活动。志愿者们为社区居民提供心','192.168.162.110','192.168.162.110','1525795200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">5月9日，为了迎接“5.12”国际护士节，贯彻落实中央、省、市委关于加强社区建设的部署要求，我院同时组织南北院区医疗护理专家志愿者三十多人分别来到越河路社区和东晋社区，开展主题为“健康中国，科普助力”2018年庆祝国际护士节科普周活动。志愿者们为社区居民提供心血管、急诊急救、危重症、糖尿病、脑卒中、母乳喂养等多专科疾病康复、保健、营养方面的咨询和培训，为300多位社区居民免费测量血压、血糖，一对一指导CPR急救技术、糖尿病饮食模型宣教，同时组织了多场保健知识相关讲座。通过此次义诊服务，充分发挥了我市护理学会急诊急救、危重症护理、心血管护理委员会的作用，为广大人民群众提供了及时、高效的医疗护理服务，落实了我院与社区共筑共建的协议。此次活动受到了社区广大居民的一致好评。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_2921fad9f685a704.JPG\" border=\"0\" width=\"312\" height=\"271\" style=\"width: 312px; height: 271px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_ff785ed674d2fbf6.JPG\" border=\"0\" width=\"303\" height=\"271\" style=\"width: 303px; height: 271px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_5d5467130c846fd3.jpg\" border=\"0\" width=\"340\" height=\"272\" style=\"width: 340px; height: 272px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_8ca2de398f89ecd4.jpg\" border=\"0\" width=\"382\" height=\"349\" style=\"width: 382px; height: 349px;\"></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2163','2983','1','','http://www1.ycsyy.com/upload/images/2019/11/s_6772e2ba481c4408.jpg','为大力普及科学知识，弘扬科学精神，传播科学生活方式，提高全民健康科学素养，5月8日盐城市第一人民医院骨科护理学组，糖尿病专业学组，伤口造口专业学组联合千鹤湾亭湖养老中心对在院72位老人，护士及护工进行应急急救知识、慢病管理及健康生活方式进行现场宣教，为老','192.168.162.110','192.168.162.110','1525708800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为大力普及科学知识，弘扬科学精神，传播科学生活方式，提高全民健康科学素养，5月8日盐城市第一人民医院骨科护理学组，糖尿病专业学组，伤口造口专业学组联合千鹤湾亭湖养老中心对在院72位老人，护士及护工进行应急急救知识、慢病管理及健康生活方式进行现场宣教，为老人们送去了健康，关爱和温暖。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">活动中，医护人员为老人们发放健康宣传册，进行PPT讲课，现场开展详细问卷调查并解答老人们咨询的各类健康问题，帮助他们解除病痛，舒缓身体不适，还为部分长期服药的老年人完善了治疗方案。并且医护人员对老人们进行了量血压，功能锻炼指导，手把手教会老人使用助行器及膝关节功能锻炼，大家在一起聊天，拉家常，其乐融融，让他们享受到晚辈们的尊敬与关爱</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">“最近觉得身体一直不舒服，全身酸痛，一直没去医院查，今天正好市一院专家来了，帮我查出病因，还教会我如何调整身体，如何在床上锻炼，真是太感谢了”，敬老院的张大爷告诉记者，医护人员的精心服务和耐心指导收到了老人们的欢迎。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">此次活动是我院健康促进服务系列活动之一，不仅为敬老院的老年居民送去了医疗服务，增强了他们预防疾病的保健意识，同时也增进了我院与敬老院的沟通联系，让老人们在家门口就能享受到健康查体和咨询服务，感受到了社会的温暖和关怀，吸引社会更多爱心人士关心关注老年人，为老年人健康保驾护航。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_6772e2ba481c4408.jpg\" border=\"0\" width=\"315\" height=\"331\" style=\"width: 315px; height: 331px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_2d98eb59da605730.jpg\" border=\"0\" width=\"344\" height=\"330\" style=\"width: 344px; height: 330px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_a5ae2fb32dc43a8a.jpg\" border=\"0\" width=\"363\" height=\"331\" style=\"width: 363px; height: 331px;\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2164','2984','1','','http://www1.ycsyy.com/upload/images/2019/11/s_8f360c49bfb626bf.jpg','2月9日上午，来自我院青年文明号集体——门诊药房、新生儿科、门诊部、眼科的10多名志愿者，来到盐城市儿童福利院，看望福利院的小朋友们。志愿者们在平时就经常来看望福利院的小朋友们，见到我们的志愿者来，小朋友们都很高兴，拉着志愿者们的手，又唱又跳。这次志愿者','192.168.162.110','192.168.162.110','1518105600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2月9日上午，来自我院青年文明号集体——门诊药房、新生儿科、门诊部、眼科的10多名志愿者，来到盐城市儿童福利院，看望福利院的小朋友们。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">志愿者们在平时就经常来看望福利院的小朋友们，见到我们的志愿者来，小朋友们都很高兴，拉着志愿者们的手，又唱又跳。这次志愿者们给小朋友们带来了小零食和日用品等，让他们体会到我们市一院志愿者们的关心和爱护。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">今后我们将继续发扬“奉献、友爱、互助、进步”的志愿者精神，多组织志愿者参与到关爱孤残儿童的活动中来，希望用我们的爱心陪伴小朋友们快乐的成长。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_8f360c49bfb626bf.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_d19bdb66a153634c.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_5e17b7d3640d87f7.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_aecd17ab784591f9.jpg\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2165','2985','1','','http://www1.ycsyy.com/upload/images/2019/11/s_5ccb28960b284e9f.JPG','为了学习贯彻落实十九大精神，坚持“不忘初心、牢记使命、永远奋斗”的工作作风，展现白衣天使救死扶伤的高尚情操，1月25日-1月26日组宣科和团委在北区住院部广场联合组织了以“学习十九大，传播正能量”为主题的无偿献血活动。献血活动从上午9时开始，来自我院各临床、','192.168.162.110','192.168.162.110','1516896000','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了学习贯彻落实十九大精神，坚持“不忘初心、牢记使命、永远奋斗”的工作作风，展现白衣天使救死扶伤的高尚情操，1月25日-1月26日组宣科和团委在北区住院部广场联合组织了以“学习十九大，传播正能量”为主题的无偿献血活动。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">献血活动从上午9时开始，来自我院各临床、医技科室的医务人员及机关后勤的工作人员陆续来到献血现场。此次献血流程分为健康咨询、填写基本信息表、体检、电脑录入、采血化验等环节，秩序井然。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">此次献血活动获得了全院党员干部、共青团员以及入党积极分子的积极响应，共有数十名医疗志愿者参加，累计献血量达数万毫升。</span></p>\r\n<p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_5ccb28960b284e9f.JPG\" border=\"0\"></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2166','2986','1','','http://www1.ycsyy.com/upload/images/2019/11/63309a04c75282f5.png','2017年10月29日是第十二个“世界卒中日”。2017年界卒中日宣传主题：预防卒中，宣传口号：预防卒中，你我同行。为切实提高人民群众脑卒中防治知识知晓率，倡导健康生活方式，落实《国家卫生计生委办公厅关于开展2017年慢性病系列宣传日活动的通知》（国卫办疾控函〔2017','192.168.162.110','192.168.162.110','1509724800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2017年10月29日是第十二个“世界卒中日”。2017年界卒中日宣传主题：预防卒中，宣传口号：预防卒中，你我同行。为切实提高人民群众脑卒中防治知识知晓率，倡导健康生活方式，落实《国家卫生计生委办公厅关于开展2017年慢性病系列宣传日活动的通知》（国卫办疾控函〔2017〕797号）文件要求，我院积极组织了各种宣传活动。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">11月4日，我院在青墩卫生院组织开展了义诊宣传活动。此次活动参加人员共有16人，包括神经内科5名医生、2位护士长，心内科1名医生，内分泌科1名医生，医务科3人，团委2人和志愿者2人。在卫生院门口摆放了高血压、高血脂、糖尿病以及脑卒中康复等相关宣传画展架，并为前来就诊的人员免费测量血压，发放宣传资料，发放卒中风险评分卡，讲解脑卒中相关防治知识。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">活动期间2位志愿者为前来就诊的患者免费测量血压50余人次，7位医生分别到该院诊室坐诊，期间累计接诊答疑100余人次。在卫生院门诊大厅为前来咨询的人员发放宣传资料，并耐心讲解了脑卒中相关方面的知识和日常生活中如何防治脑卒中的发生，共计发放宣传资料100余人次。在活动结束之际，我院神经内科左其龙主任特意为前来咨询的人员开展了一个如何预防脑卒中的小课堂，详细讲述了中分的危险、症状和及时就诊的重要性。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 此次活动进一步增强了人们对脑卒中危害的认识，珍惜生命，关注大脑。提醒广大居民，预防脑卒中，一定要从控制高血压、高血糖、高血脂等基础疾病做起，改善不良生活习惯，适当运动。一旦患了脑卒中，及时合理的综合治疗是关键，预防复发也是很重要的一个环节。此次义诊活动也为接下来的随访干预工作打下了基础，得到群众的支持。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/63309a04c75282f5.png\" title=\"image.png\" alt=\"image.png\" width=\"377\" height=\"484\" style=\"width: 377px; height: 484px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3f7d61e0f6d05a67.png\" title=\"image.png\" alt=\"image.png\" width=\"356\" height=\"482\" style=\"width: 356px; height: 482px;\" /></p><p><span class=\"edui-editor-imagescale-hand1\" style=\"\"></span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/7d029fba0d3d30a5.png\" title=\"image.png\" alt=\"image.png\" width=\"374\" height=\"502\" style=\"width: 374px; height: 502px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/490094bb5b157b08.png\" title=\"image.png\" alt=\"image.png\" width=\"360\" height=\"503\" style=\"width: 360px; height: 503px;\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/7eafb1a2e787f254.png\" title=\"image.png\" alt=\"image.png\" width=\"516\" height=\"409\" style=\"width: 516px; height: 409px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/dba235cf2e30a4b9.png\" title=\"image.png\" alt=\"image.png\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/18e9c8a2dfb02c78.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/fa61a450151aef7f.png\" title=\"image.png\" alt=\"image.png\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/f66588af469fed51.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/358a4e59520abde3.png\" title=\"image.png\" alt=\"image.png\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/26707dcb544135b2.png\" title=\"image.png\" alt=\"image.png\" width=\"446\" height=\"536\" style=\"width: 446px; height: 536px;\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_314ac141eb10b547.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_28de6c5011de41fe.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_b2633167b95cc936.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_dbdddddbc78b8775.jpg\" border=\"0\" /></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2167','2987','1','','http://www1.ycsyy.com/upload/images/2019/11/s_97699480e69b57bc.jpg','为了建设人民满意的医疗体系，提高人民群众的健康水平，缓解基层群众“看病难、看病贵”问题，更好的服务百姓，根据省卫计委、江苏省中医药局、无锡联勤保障中心卫勤处联合下发的《2017“健康江苏服务百姓”大型义诊活动周实施方案》的要求，我院积极组织了两场义诊活动','192.168.162.110','192.168.162.110','1505836800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为了建设人民满意的医疗体系，提高人民群众的健康水平，缓解基层群众“看病难、看病贵”问题，更好的服务百姓，根据省卫计委、江苏省中医药局、无锡联勤保障中心卫勤处联合下发的《2017“健康江苏服务百姓”大型义诊活动周实施方案》的要求，我院积极组织了两场义诊活动，得到了群众的一致好评。具体情况汇报如下:</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">一、赴射阳县人民医院义诊</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2017年9月15日我院由分管院长牵头，医务科郭建军科长带队组建了以肾脏内科杨吉明主任为首的涵盖老、中、青三代医生的义诊队伍，这支队伍分别来自我院肾脏内科、呼吸内科、神经内科、妇产科、普通外科、消化内科、神经内科、内分泌科，全部由副主任医师及以上职称的同志参加，其中还有3名博士研究生，代表我院医疗水平的中坚力量。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">8位同志抵达射阳县人民医院后立即开展工作，肾脏内科杨吉明主任医师、神经内科严峻副主任医师至内科病房对疑难病人进行查房，经过详细询问病史、仔细查体，了解病情的一手资料，再通过和当地医生的交流获得了目前诊疗过程中存在的疑难点，在掌握了病人的情况后，针对该病人进行了一次教学查房，从病情分析、明确诊断、治疗方法选择、疾病转归等方面进行全面讲解，并和患者及其家属进行一次医患沟通，全方位地完成了一次规范化诊疗的全过程；普通外科臧书源博士、妇产科曹媛媛副主任医师至手术室分别完成了一台手术，虽然这两台手术为常规手术，但是通过两位医师的言传身教对射阳县医院的年轻医生进行一次带教，常规手术也应该规范，也需要精细，也可以精彩；其余4位同志，心血管内科张金龙博士、消化内科姜中华博士、内分泌科李政副主任医师、呼吸内科薛金山副主任医师在门诊坐诊，在繁忙的门诊工作中与当地患者亲切交流，答疑解惑，能解决的问题当场解决，需要进一步检查的给出方案供患者选择，当地无法解决的建议其至我院诊治并留下了联系方式。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">通过两家医院的共同努力，圆满地完成了在射阳县人民院的义诊活动，此次义诊共计进行疑难病例讨论2例，手术示教2例，查看门诊患者100余人，得到了当地患者的一致好评。于此同时，双方医生之间也有机会进行了友好的交流，互留联系方式，为今后进一步联系提供了良好的契机。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">二、院内义诊</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2017年9月16日在我院北区门诊大厅里，我院又组织了一次义诊活动，参与这次义诊的有肾脏内科杨吉明主任医师、心血管内科王小平主任医师、消化内科吴旭东主任医师、内分泌科郝兰香副主任医师、妇产科徐敏副主任医师、普外科刘根祥副主任医师、呼吸内科薛金山副主任医师、神经内科严峻副主任医师。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">此次院内义诊活动主要面向来我院就诊的患者，向他们提供必要的医疗咨询服务，需要诊疗可以即刻进行检查、诊治。短短几个小时的时间接待了200余人次的患者及家属的咨询，为一些患者提供了初步诊疗意见，给予他们今后诊疗的建议和平时生活中需要注意的事项；对一些确实需要进一步诊疗的患者，由志愿者引导他们到相应的科室挂号诊治；对一些患有多种基础疾病的患者，现场进行了一次小型的会诊，此次义诊活动得到了患者及家属的肯定。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_97699480e69b57bc.jpg\" border=\"0\" width=\"358\" height=\"345\" style=\"width: 358px; height: 345px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_e4a73dc59067242b.jpg\" border=\"0\" width=\"368\" height=\"346\" style=\"width: 368px; height: 346px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_5dd1c4af4b19988b.jpg\" border=\"0\" width=\"312\" height=\"346\" style=\"width: 312px; height: 346px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_f75a5f476c835adc.jpg\" border=\"0\" width=\"398\" height=\"380\" style=\"width: 398px; height: 380px;\"></span></p>\r\n<p></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2168','2988','1','','http://www1.ycsyy.com/upload/images/2019/11/s_e9245a940c959f84.jpg','6月14日，市一院组织党员志愿者奔赴射阳县千秋镇开展扶贫帮困活动。在千秋卫生院，医务党员志愿者为200多名群众开展义诊服务，护理党员志愿者为100多名驻村、学校、社区卫生员开展心肺复苏培训。此外，党员志愿者还走访慰问了三区、推广、滨东三个村100户贫困农户并送上','192.168.162.110','192.168.162.110','1497369600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">6月14日，市一院组织党员志愿者奔赴射阳县千秋镇开展扶贫帮困活动。在千秋卫生院，医务党员志愿者为200多名群众开展义诊服务，护理党员志愿者为100多名驻村、学校、社区卫生员开展心肺复苏培训。此外，党员志愿者还走访慰问了三区、推广、滨东三个村100户贫困农户并送上慰问金。此次扶贫慰问活动，受到了广大群众的一致好评。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_e9245a940c959f84.jpg\" border=\"0\" width=\"313\" height=\"299\" style=\"width: 313px; height: 299px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_7df751daa2714e67.JPG\" border=\"0\" width=\"311\" height=\"298\" style=\"width: 311px; height: 298px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_d5eb7ff120eb29bf.JPG\" border=\"0\" width=\"360\" height=\"299\" style=\"width: 360px; height: 299px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_99911690b68bb646.JPG\" border=\"0\" width=\"406\" height=\"379\" style=\"width: 406px; height: 379px;\" /></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2169','2989','1','','http://www1.ycsyy.com/upload/images/2019/11/s_3b61056725e85d9b.jpg','5月6日，为了迎接“5.12”国际护士节，市一院组织南北院区医疗护理专家志愿者三十余人来到城南新区龙园新村，开展主题为“健康中国科普助力”2017年全国科技周暨江苏省第二十九届科普宣传周活动。志愿者们为社区居民提供心血管、急诊急救、危重症、糖尿病、脑卒中等多专','192.168.162.110','192.168.162.110','1494000000','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">5月6日，为了迎接“5.12”国际护士节，市一院组织南北院区医疗护理专家志愿者三十余人来到城南新区龙园新村，开展主题为“健康中国科普助力”2017年全国科技周暨江苏省第二十九届科普宣传周活动。志愿者们为社区居民提供心血管、急诊急救、危重症、糖尿病、脑卒中等多专科疾病康复、保健、营养方面的咨询和培训，为300多位居民免费测血压、血糖，一对一指导CPR急救技术、糖尿病饮食模型宣教，还做了三场保健知识相关讲座。通过此次义诊服务，充分发挥了我市护理学会急诊急救、危重症护理、心血管护理委员会的作用，为广大人民群众提供了及时、高效的医疗护理服务。此次活动受到了社区广大居民的一致好评。</span></p>\r\n<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_3b61056725e85d9b.jpg\" border=\"0\" width=\"336\" height=\"375\" style=\"width: 336px; height: 375px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_ac80ee834cac0280.jpg\" border=\"0\" width=\"311\" height=\"375\" style=\"width: 311px; height: 375px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_2ae0427499e2c125.jpg\" border=\"0\" width=\"433\" height=\"375\" style=\"width: 433px; height: 375px;\"></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2170','2990','1','','http://www1.ycsyy.com/upload/images/2019/11/s_f2c96dc084a979ff.JPG','为使广大市民认识和了解疼痛，如术后疼痛、慢性腰腿痛、退行性骨关节炎、骨质疏松症、癌性疼痛及神经病理性疼痛，让患者学会如何在疼痛专科医师的帮助下创造无痛生活，3月4日，我院疼痛科邀请了省内外的疼痛科专家在我院北区门诊大厅开展义诊活动，为市民免费提供疼痛咨','192.168.162.110','192.168.162.110','1488556800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为使广大市民认识和了解疼痛，如术后疼痛、慢性腰腿痛、退行性骨关节炎、骨质疏松症、癌性疼痛及神经病理性疼痛，让患者学会如何在疼痛专科医师的帮助下创造无痛生活，3月4日，我院疼痛科邀请了省内外的疼痛科专家在我院北区门诊大厅开展义诊活动，为市民免费提供疼痛咨询及疼痛相关知识的普及宣教，帮助市民改变观念,纠正对疼痛的误区，接受新的疼痛治疗理念。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">随着现代生活节奏的加快，各种疼痛性疾病的发病率迅速上升，慢性疼痛已成为继心脑血管疾病、肿瘤等严重影响人类生活和生命质量的另一大杀手。在医院门诊的就诊病人中，2/3的病人都曾受过疼痛的困扰，然而大多数人却并未意识到疼痛也需要及时就诊。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">本次活动共义诊患者400余人，受到了群众的广大好评。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_f2c96dc084a979ff.JPG\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/s_3e610d2a159d8dd0.JPG\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2171','2991','1','','http://www1.ycsyy.com/upload/images/2019/11/e366c9f5ae776cec.png','2019年10月21日，市一院老干部党支部召开支部党员大会，组织离退休党员同志认真学习了以下内容：1.《习近平新时代中国特色社会主义思想学习纲要》；2.《习近平关于“不忘初心、牢记使命”论述摘编》；3.习近平在庆祝中华人民共和国成立70周年大会上的讲话。2019年10月21','192.168.162.110','192.168.162.110','1571587200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2019年10月21日，市一院老干部党支部召开支部党员大会，组织离退休党员同志认真学习了以下内容：</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">1.《习近平新时代中国特色社会主义思想学习纲要》；</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2.《习近平关于“不忘初心、牢记使命”论述摘编》；</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">3.习近平在庆祝中华人民共和国成立70周年大会上的讲话。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/e366c9f5ae776cec.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/c7579cdc0447b819.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2019年10月21日下午，市一院老干部党支部开展了党组织统一活动日活动，支部书记为党员们上了专题党课、组织离退休党员开展“四重四亮”活动。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2869975c3cd31623.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">上图为支部书记朱临梅正在为离退休党员同志上党课</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">下图为离退休党员李明在重读入党志愿</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/7bed8c0ab0dfb97b.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">离退休党员候玉珍同志在重读入党志愿</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/37ba57e88444c2ed.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">离退休党员支部委员王仁英同志在重读入党志愿</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9e1b150a33c24999.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">离退休党员支部委员周正旺同志在重读入党志愿</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/4dccd51baf18d5b7.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">离退休党员支部委员杭荣辉同志在重读入党志愿</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3717f5047052290a.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">离退休党支部支部委员李祥同志在重读入党志愿</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/7b8fb022d2da3e96.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">离退休党员范长志同志在重读入党志愿</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/6c049a0103e7fe63.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">支部书记带领离退休党员一起重温入党誓词</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/93302b104d3c7b75.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/c83740034c9bffef.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2172','2992','1','','http://www1.ycsyy.com/upload/images/2019/11/6c46b0e5503f39bb.png','为迎接新中国成立70周年，激发离退休干部爱党爱国热情，我院老干部支部于2019年8月1日召开了“我看新中国成立70周年新成就”专题研讨交流活动。作为共和国成长的参与者、见证者，老同志们共同回忆新中国崛起历程，心潮澎湃，感慨万千，言谈话语充满正能量。','192.168.162.110','192.168.162.110','1564588800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为迎接新中国成立70周年，激发离退休干部爱党爱国热情，我院老干部支部于2019年8月1日召开了“我看新中国成立70周年新成就”专题研讨交流活动。作为共和国成长的参与者、见证者，老同志们共同回忆新中国崛起历程，心潮澎湃，感慨万千，言谈话语充满正能量。</span></p><p><img src=\"http://www1.ycsyy.com/upload/images/2019/11/6c46b0e5503f39bb.png\" title=\"image.png\" alt=\"image.png\" width=\"371\" height=\"261\" style=\"width: 371px; height: 261px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/5c225232b8a13b46.png\" title=\"image.png\" alt=\"image.png\" width=\"286\" height=\"261\" style=\"width: 286px; height: 261px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/8ef888763bd1608c.png\" title=\"image.png\" alt=\"image.png\" width=\"445\" height=\"260\" style=\"width: 445px; height: 260px;\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2173','2993','1','','http://www1.ycsyy.com/upload/images/2019/11/715a80ce1db45a6b.png','2019年7月19日下午，市一院离退休干部处邀请市消防队的教官为老同志们作消防知识讲座。','192.168.162.110','192.168.162.110','1563465600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2019年7月19日下午，市一院离退休干部处邀请市消防队的教官为老同志们作消防知识讲座。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/715a80ce1db45a6b.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/23cf714af7a660b8.png\" title=\"image.png\" alt=\"image.png\" width=\"542\" height=\"344\" style=\"width: 542px; height: 344px;\" /></span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2174','2994','1','','http://www1.ycsyy.com/upload/images/2019/11/245709ba8f6c5789.png','春意盎然，春风送暖。为深入学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神，以“讴歌新时代，增添正能量，我看新中国成立70周年”主题教育活动开展为载体，进一步丰富我院离退休党员干部职工的精神文化生活。按照院党委要求，2019年5月9日，市一院老干部支','192.168.162.110','192.168.162.110','1557331200','<p style=\"text-indent: 57px; line-height: 3em;\"><span style=\"letter-spacing: 1px; font-size: 20px; font-family: 宋体, SimSun;\">春意盎然，春风送暖。为深入学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神，以“讴歌新时代，增添正能量，我看新中国成立70周年”主题教育活动开展为载体，进一步丰富我院离退休党员干部职工的精神文化生活。按照院党委要求，2019年5月9日，市一院老干部支部组织全院140多名离退休党员同志赴淮安红色文化教育和历史文化教育基地，开展党日活动现场教学。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/245709ba8f6c5789.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">周恩来同志是伟大的马克思主义者，伟大的无产阶级革命家、政治家、军事家、外交家，党和国家主要领导人之一，中国人民解放军主要创建人之一，中华人民共和国的开国元勋，是以毛泽东同志为核心的党的第一代中央领导集体的重要成员。他的卓著功勋、崇高品德、光辉人格，深深铭记在全国各族人民心中。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在纪念馆中，老党员同志们学习了周恩来同志的家世家风，了解了他投身革命的光辉历程，倾听了他许多大公无私的感人事迹。在周恩来同志的铜像面前，支部的党员同志们重温入党誓词。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/575b9d7c9318fdcc.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9398f9c4101a96fd.png\" border=\"0\" /></span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/70510753491b402b.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">不忘初心跟党走，牢记使命勇担当。此次的党日活动，院离退休干部处在医院党委的指导下，精心准备、认真组织，整个活动受到了广大老党员同志们的交口称赞，大家纷纷表示要发挥余热，为医院的基层党建添砖加瓦，为推动医院高质量发展贡献力量。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/967f86e712ee86ad.png\" border=\"0\" /></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2175','2995','1','','http://www1.ycsyy.com/upload/images/2019/11/e101d36d2d3264a7.png','2019年1月9日下午，市一院老干部支部开展离退休党员2018年度“正能量之星”推荐表彰活动。参会党员积极工作，通过严格的程序推荐出年度的优秀老干部。','192.168.162.110','192.168.162.110','1546963200','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2019年1月9日下午，市一院老干部支部开展离退休党员2018年度“正能量之星”推荐表彰活动。参会党员积极工作，通过严格的程序推荐出年度的优秀老干部。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/e101d36d2d3264a7.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/12cf09b224ff094f.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/8908b3f2f1a48740.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/bbb919eb0772597a.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2176','2996','1','','http://www1.ycsyy.com/upload/images/2019/11/9797b8ddcdc2078d.png','为丰富我院离退休职工的文化生活，我院离退休干部处在2018年重阳节来临之际，前组织了一场离退休职工掼蛋比赛，选手通过激烈的角逐，产生了优胜奖。图为比赛现场。2018年10月11日上午，我院离退休干部处组织部分离退休老同志开展投掷羽毛球比赛，比赛现场热闹纷呈。瞧大','192.168.162.110','192.168.162.110','1536422400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为丰富我院离退休职工的文化生活，我院离退休干部处在2018年重阳节来临之际，前组织了一场离退休职工掼蛋比赛，选手通过激烈的角逐，产生了优胜奖。图为比赛现场。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9797b8ddcdc2078d.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/6c6ae91d4fde5968.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/1db2770666acb833.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/4452dd7b542507c.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/f40fe610455a5b99.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2bf997778d447083.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/66ae122a2e3facf1.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span></p><p style=\"text-indent: 59px; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><br /></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年10月11日上午，我院离退休干部处组织部分离退休老同志开展投掷羽毛球比赛，比赛现场热闹纷呈。瞧大家赛的多认真，玩得多开心！</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span><img src=\"http://www1.ycsyy.com/upload/images/2019/11/a9be502eb6a348db.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9010e83b1fdd2a2f.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/86b9df37fa52b4d6.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/33434c6ae09fb7ab.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9e157d423da2432e.png\" border=\"0\" /></p><p style=\"margin-left: 15px; text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">获奖了！！！</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/e40f6581bef12fd7.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2177','2997','1','','http://www1.ycsyy.com/upload/images/2019/11/5e2b10fb0a40970.png','2018年1月10日，老干支部表彰了2017年度的“正能量之星”，有多位在支部活动中积极，传播良好风范，家风的老同志受到了表彰奖励。表彰奖励2017年度“正能量之星”','192.168.162.110','192.168.162.110','1515513600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年1月10日，老干支部表彰了2017年度的“正能量之星”，有多位在支部活动中积极，传播良好风范，家风的老同志受到了表彰奖励。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/5e2b10fb0a40970.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/fb486e7fb009eb92.png\" border=\"0\" /></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">表彰奖励2017年度“正能量之星”</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/d6356b06a5e448b9.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/62f1a49fe46260d7.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2178','2998','1','','http://www1.ycsyy.com/upload/images/2019/11/753cefe603573e85.png','为深入推进我院离退休党员干部“两学一做”学习教育活动，巩固大家一年来的学习成果，进一步提高我院离退休党员干部的综合素质，在建党96周年到来之际，我院老干部支部开展了离退休党员党建知识竞赛活动。通过抢答、笔试的激烈争夺，徐国旭、冯荣亮等二名同志获一等奖，','192.168.162.110','192.168.162.110','1512057600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为深入推进我院离退休党员干部“两学一做”学习教育活动，巩固大家一年来的学习成果，进一步提高我院离退休党员干部的综合素质，在建党96周年到来之际，我院老干部支部开展了离退休党员党建知识竞赛活动。通过抢答、笔试的激烈争夺，徐国旭、冯荣亮等二名同志获一等奖，程树星、郭松林、徐杏棣、李德贵等四名同志获二等奖，候玉珍、周增宽、左明礼、夏玲、陈仁万、周美和等六名同志获三等奖。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/753cefe603573e85.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/8130a05ea43a007f.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/ad82666edae6348c.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/e34cab5c20318cf4.png\" title=\"image.png\" alt=\"image.png\" width=\"314\" height=\"250\" style=\"width: 314px; height: 250px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3d86b5ab666dba2e.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b1bf1ef05eb9f9ad.png\" title=\"image.png\" alt=\"image.png\" width=\"317\" height=\"245\" style=\"width: 317px; height: 245px;\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/c5e9c2ed23f7730e.png\" title=\"image.png\" alt=\"image.png\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2179','2999','1','','http://www1.ycsyy.com/upload/images/2019/11/b0d0aedb3a2c7549.png','在2017年国庆、中秋、重阳佳节来临之际， 10月5号市一院离退休职工“庆国庆、度中秋、迎重阳”系列活动拉开了帷幕。老干部踊跃参加，纷纷用行到表达对建国七十周年的热爱。王志才、张孝琴夺走了掼蛋比赛的桂冠；李德贵荣获象棋比赛的第一名；杨忠达获书画比赛第一名。','192.168.162.110','192.168.162.110','1507132800','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">在2017年国庆、中秋、重阳佳节来临之际， 10月5号市一院离退休职工“庆国庆、度中秋、迎重阳”系列活动拉开了帷幕。老干部踊跃参加，纷纷用行到表达对建国七十周年的热爱。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">王志才、张孝琴夺走了掼蛋比赛的桂冠；李德贵荣获象棋比赛的第一名；杨忠达获书画比赛第一名。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b0d0aedb3a2c7549.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/be4a4bacb881ed00.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/70236261e9fce3dd.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/13d1ff4e1c4bdaba.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/a27a842be2086f61.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2059ce091703a280.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2180','3000','1','','http://www1.ycsyy.com/upload/images/2019/11/2196def87d5e4497.png','2017年9月19日下午，在院领导的关心下，在医院南区办公室的大力支持下，我院离退休干部处组织了部分离退休老同志参观了盐城市第一人民医院南区，让老同志实地了解医院发展的大好形 山册册势，分享医院发展成果，进一步促进老领导、老同志对医院工作的理解与支持。老同志','192.168.162.110','192.168.162.110','1505750400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2017年9月19日下午，在院领导的关心下，在医院南区办公室的大力支持下，我院离退休干部处组织了部分离退休老同志参观了盐城市第一人民医院南区，让老同志实地了解医院发展的大好形 山册册势，分享医院发展成果，进一步促进老领导、老同志对医院工作的理解与支持。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2196def87d5e4497.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们正津津有味地听办公室小罗给大家介绍医院南区的情况</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/34132621d752a147.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/f0b6f9b56b8fe7dc.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/940e2419b9c794d.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们边走边看，连连称赞我们医院南区真漂亮！医院发展真快！</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/89353f76fbcfd0d5.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们在门诊药房参观了药房自动发药流程系统，直感叹高科技就是神奇！</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/25a3520cbd92bd23.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/49020444bb939af0.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/7573a115c22d2b38.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">手术室护士长和消化科护士长热情地给大家介绍病区的情况，老同志们问东问西可感兴趣了。</span></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们兴趣勃勃地追着小罗问这问那，恨不得把自己不清楚的事一下子全弄明白</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/f17bfa6eb8f99c1c.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/ee3b0495f2357b07.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2181','3001','1','','http://www1.ycsyy.com/upload/images/2019/11/5a7fd8f7f5d329df.jpg','为丰富我院离退休干部职工的精神文化生活，受院党委的委托，我院离退休干部处及老干支部于4月18日和20日两天，分两批组织全院200多名离退休老同志赴南通如皋市水绘园、长寿园参观赏游。在和煦的春光中，老同志们参观了代表江南园林风格的如皋水绘园，兼具自然秀美和人文','192.168.162.110','192.168.162.110','1492617600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为丰富我院离退休干部职工的精神文化生活，受院党委的委托，我院离退休干部处及老干支部于4月18日和20日两天，分两批组织全院200多名离退休老同志赴南通如皋市水绘园、长寿园参观赏游。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在和煦的春光中，老同志们参观了代表江南园林风格的如皋水绘园，兼具自然秀美和人文底蕴的美景给老同志留下了极其深刻的印象。通过游览，老同志们了解了历史，开阔了眼界，锻炼了身体，颐养了身心。在长寿园，大家浏览了世界最大的寿星像，祈福长寿安康。此外还组织老同志到如皋园艺馆和李昌钰刑侦博物馆赏花、参观，进一步开拓眼界。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">离退休干部处精心准备、悉心负责、考虑周全，整个参观考察活动安全顺畅愉悦，受到了广大老同志的交口称赞。此次活动的成功举办，也标志着老干部支部4月份党员活动日的一项重要内容圆满完成。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/5a7fd8f7f5d329df.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3a985cef969b440f.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/addde6a66634f72e.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/6991b73812f2d86f.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/613163a92bec447e.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3d3d2267df3521e7.jpg\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/cfe56896c410ed64.jpg\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2182','3002','1','','http://www1.ycsyy.com/upload/images/2019/11/c3184c0df3c6fcb4.png','为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，2017年2月9日下午，我院离退休干部科在老干部活动中心组织开展了一次别开生面的猜灯谜活动。图为老同志们在活动现场积极参加猜谜活动。','192.168.162.110','192.168.162.110','1486569600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，2017年2月9日下午，我院离退休干部科在老干部活动中心组织开展了一次别开生面的猜灯谜活动。图为老同志们在活动现场积极参加猜谜活动。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/c3184c0df3c6fcb4.png\" border=\"0\" /></span></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2d36d55f3716aeb8.png\" border=\"0\" /></span></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b7a0de97761bf2c6.png\" border=\"0\" /></span></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/34d41a93e6996868.png\" border=\"0\" /></span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2183','3003','1','','http://www1.ycsyy.com/upload/images/2019/11/123c6355883e0a25.jpg','各位离退休老同志：接省委、市委老干部局、离退休干部工委的通知精神，为庆祝中国共产党成立100周年，引导离退休干部讲好党的故事，传承红色基因，弘扬革命精神，特面向我院全体离退休老同志组织开展庆祝中国共产党成立100周年征文比赛。现将有关事项通知如下：一、征文','192.168.162.110','192.168.162.110','1619107200','<p style=\"line-height: 32px; text-align: left;\"><span style=\"font-family: 宋体; font-size: 19px;\">各位离退休老同志：</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">接省委、市委老干部局、离退休干部工委的通知精神，为庆祝中国共产党成立</span><span style=\"font-size:19px\">100</span><span style=\"font-size:19px;font-family:宋体\">周年，引导离退休干部讲好党的故事，传承红色基因，弘扬革命精神，特面向我院全体离退休老同志组织开展庆祝中国共产党成立</span><span style=\"font-size:19px\">100</span><span style=\"font-size:19px;font-family:宋体\">周年征文比赛。现将有关事项通知如下：</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">一、征文主题：围绕庆祝建党</span><span style=\"font-size:19px\">100</span><span style=\"font-size:19px;font-family: 宋体\">周年，结合亲身经历和所学所思，讲述在党的领导下投身革命、建设、改革的历史瞬间、感人故事和切身体会，讴歌和反映我们党的辉煌成就和宝贵经验，特别是展现新时代在以习近平同志为核心的党中央的坚强领导下，党和国家各项事业取得的历史性成就、发生的历史性变化，我市推进“四新盐城”建设取得的显著成绩，大力弘扬党的光荣传统和优良作风，唱响共产党好、社会主义好、改革开放好、伟大祖国好、各族人民好的主旋律。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">二、征文时间：从通知之日起到</span><span style=\"font-size:19px\">2021</span><span style=\"font-size:19px;font-family:宋体\">年</span><span style=\"font-size:19px\">5</span><span style=\"font-size:19px;font-family: 宋体\">月</span><span style=\"font-size: 19px\">22</span><span style=\"font-size:19px;font-family:宋体\">日为止。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">三、征文体裁：回忆录、散文、纪实文学、学习心得均可，字数一般不超过</span><span style=\"font-size:19px\">3000</span><span style=\"font-size:19px;font-family:宋体\">字。要求内容真实、语言流畅、情感真挚，须是原创作品。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">四、投稿邮箱：</span><span style=\"font-size:19px\">654151792@qq.com</span><span style=\"font-size:19px;font-family:宋体\">，邮件主题命名为“征文比赛</span><span style=\"font-size:19px\">+</span><span style=\"font-size:19px;font-family: 宋体\">作品题目</span><span style=\"font-size: 19px\">+</span><span style=\"font-size:19px;font-family:宋体\">作者姓名”。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">五、奖项设置：一等奖</span><span style=\"font-size:19px\">1</span><span style=\"font-size:19px;font-family: 宋体\">名，二等奖</span><span style=\"font-size:19px\">2</span><span style=\"font-size:19px;font-family: 宋体\">名，三等奖</span><span style=\"font-size:19px\">3</span><span style=\"font-size:19px;font-family: 宋体\">名，优秀奖若干名，对获奖者将发放一定的奖品。</span></p>\r\n<p style=\"line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">（本次活动的解释权属于医院离退休干部处）</span></p>\r\n<p style=\"line-height: 32px; text-align: right;\"><span style=\"font-size:19px\"> </span></p>\r\n<p style=\"text-indent: 271px; line-height: 32px; text-align: right;\"><span style=\"font-size:19px;font-family:宋体\">盐城市第一人民医院离退休干部处</span></p>\r\n<p style=\"line-height: 32px; text-align: right;\"><span style=\"font-size:19px\">  2021</span><span style=\"font-size:19px;font-family:宋体\">年</span><span style=\"font-size:19px\">4</span><span style=\"font-size:19px;font-family:宋体\">月</span><span style=\"font-size:19px\">23</span><span style=\"font-size:19px;font-family: 宋体\">日</span></p>\r\n<p></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2184','3004','1','','','各位离退休老同志：大家好！经医院统一安排定于2021年4月1日至2021年4月6日（7：00-9：00）为全院离退休职工健康体检。请大家在规定的时间内携带本人身份证直接到体检中心参加体检。本次体检仅限本人，不得转让！体检结束后，务必将体检指引单留交体检中心，否则无法获','192.168.162.110','192.168.162.110','1615910400','<p><span style=\"font-family: 宋体; font-size: 18px;\"></span></p><p><span style=\"font-size: 18px;\"><br /></span></p><p style=\"text-indent: 0em; text-align: left;\"><span style=\"font-size: 18px;\">各位离退休老同志：</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 18px;\">大家好！</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 18px;\">经医院统一安排定于2021年4月1日至2021年4月6日（7：00-9：00）为全院离退休职工健康体检。请大家在规定的时间内携带本人身份证直接到体检中心参加体检。本次体检仅限本人，不得转让！体检结束后，务必将体检指引单留交体检中心，否则无法获取体检结果。体检报告在规定体检时间结束一周后，到院老年活动中心领取！请看到通知的老同志相互转告！</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 19px; font-family: 宋体;\"><br /></span></p><p style=\"text-indent:280px\"><span style=\"font-size: 18px;\"></span></p><p style=\"text-indent: 280px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 18px;\">离退休干部处</span></p><p style=\"text-indent: 299px; text-align: right;\"><span style=\"font-size: 18px;\">2021.3.17</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2185','3005','1','','','：全院离退休职工同志们正月十五是我国传统的元宵佳节，为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，离退休干部处将组织猪年“元宵灯谜”活动，欢迎广大离退休职工积极参与。活动时间：2019年2月19日下午2：30－3：00活动地点：','192.168.162.110','192.168.162.110','1549900800','<p style=\"line-height: 3em; text-indent: 0em;\"></p><p style=\"line-height: 3em; text-indent: 0em;\"></p><p style=\"line-height: 3em; text-indent: 0em; text-align: left;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px; text-indent: 2em;\">：全院离退休职工同志们</span><br /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">正月十五是我国传统的元宵佳节，为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，离退休干部处将组织猪年“元宵灯谜”活动，欢迎广大离退休职工积极参与。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">活动时间：2019年2月19日下午2：30－3：00</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">活动地点：老干部支部活动室</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">市一院离退休干部处</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">二O一九年二月十二日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2186','3006','1','','','2018年是我国改革开放40周年。40年来，从城市到乡村，从衣食到住行，从脱贫攻坚到生态文明，中国社会发生了翻天覆地的变化。个人和家庭与国家的变革历程序紧紧相连、息息相关，我们伴随改革开放一路走来，亲历、见证了盐城墙0年来有目共睹、触手可及的巨大变化，感觉最','192.168.162.110','192.168.162.110','1544284800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年是我国改革开放40周年。40年来，从城市到乡村，从衣食到住行，从脱贫攻坚到生态文明，中国社会发生了翻天覆地的变化。个人和家庭与国家的变革历程序紧紧相连、息息相关，我们伴随改革开放一路走来，亲历、见证了盐城墙0年来有目共睹、触手可及的巨大变化，感觉最真，情意最切，体会最深。为庆祝改革开放40周年，我院老干部支部组织开展“我看改革开放40年”主题征文活动。现将相关事宜通知如下：</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">一、征文主题</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">“我看改革开放40年”，改革开放寻与者、奋斗者、见证者的心路与难忘记忆，反映盐城人在40年改革历程中的不懈努力，展示盐城人在新时代的崭新面貌。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">三、征文对象</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">面向组织关系在老干部支部的所有党员，欢迎大家踊跃投稿。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">四、征文要求</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">围绕40年来与改革开放紧密相连的城乡发展、时代变迁、生活和人生轨迹，以亲身经历的故事和身边点点滴滴的变化，以小见大，见微知著，从不同角度、不同侧面，反映改革开放大背景下盐城人民生产生活、风俗习惯、思想观念更新的真实图景，为盐城40年波澜壮阔的发展长卷留下细腻可感、动人心弦的个体“微历史”，鼓舞激励盐城人民沿着改革开放的道路继续前进，凝聚起同心建设“富美盐城”的磅礴力量。征文不限，有真情实感，主题鲜明、条理清晰、生动鲜活，有较强的可读性和感染力。字数控制在3000字以内。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">五、评选表彰</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">本次征文设特等奖、一等奖、二等奖、三等奖及优秀奖若干，对获奖者给予不同层次的奖励。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">六、投稿方式</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">纸质材料邮寄或直接送到老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">七、征文时间</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">即日起至2019年3月1日</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">盐城市第一人民医院老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年12月9日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2187','3007','1','','','：各位离退休党员为推动我院离退休干部党支部建设，2018年来我们离退休干部党支部继续开展了“夕阳生金辉、厚德耀盐城、增添正能量”主题活动，为积极引导全院离退休老干部为党和人民事业增添正能量，为建设新一院作出新的更大贡献，我院老干部支部在2019年新春来临之际','192.168.162.110','192.168.162.110','1544284800','<p style=\"line-height: 3em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休党员</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(51, 51, 51);\">为推动我院离退休干部党支部建设，2018年来我们离退休干部党支部继续开展了</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(34, 34, 34);\">“夕阳生金辉、厚德耀盐城、增添正能量”主题活动，为积极引导全院离退休老干部为党和人民事业增添正能量，为建设新一院作出新的更大贡献</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(81, 81, 81);\">，我院老干部支部在2019年新春来临之际，将评选表彰一批“正能量之星”。现将有关事项通知如下： </span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"line-height: 150%; color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\">一、评选表彰的目的和意义</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(81, 81, 81);\">在离退休党员干部中评选表彰“正能量之星”,</span> <span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(51, 51, 51);\">旨在</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(34, 34, 34);\">充分发挥典型的示范引领作用，在离退休干部中营造积极向上的浓厚氛围，为建设新盐城提供强大的精神动力和道德支持，</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(81, 81, 81);\">对我院调动离退休干部党员自我教育、自我提高的积极性和主动性，充分发挥离退休干部党员的先锋模范作用，具有重要意义。</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">二、评选表彰的标准:</span></strong> </span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">(</span></strong><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">一)学习之星 </span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）注重政治理论学习，在政治思想上行动上与党中央保持一致；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）积极参加各类学习活动，并在活动中起带头作用；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）喜欢并积极学习新知识，新技能、新技术，不断丰富知识体系；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）通过自学或上老年学校，学习并掌握1－2门专业知识或技能；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（5）能运用自己学习成果改变身边老同志对待学习的态度。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（二）健康之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）拥有健康的生活理念和生活方式，并宣传积极养老观念和健康生活理念；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）心理健康。保持积极健康乐观的心态，看待问题客观，面对困难乐观，有良好的社会适应性；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）身体健康长寿，日常生活活动正常；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）家庭关系和睦，心态乐观向上，人际关系良好；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（5）积极参加健身活动，能够长期坚持1－2项锻炼方法，在老同志健康活动中起带头作用，并能主动自愿带动其他老同志共同锻炼。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（三）关爱之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）具有一颗关爱他人，助人为乐的慈爱之心；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）踊跃加入各级关心下一代工作委员会组织，并积极参加各项活动；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）关心青少年的成长工作或结对助学等方面有突出表现；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）关爱青少年并积极帮助解决实际困难；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（5）邻里关系和睦，在离退休干部中发挥积极的团结作用。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">(</span></strong><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">四)奉献之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）大力弘扬“一方有难、八方支援”的革命传统和乐于奉献的社会风尚；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）发挥自身优势积极参加志愿者服务活动；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）热心社会公益事业，有扶贫帮困、爱心捐赠等方面有突出表现；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）带领身边同志积极帮助单位或支部其他需要帮助的老同志；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（五）家风之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（1）</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">以身作则，言传身教，</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">家庭幸福，夫妻互敬，子女孝顺；</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）自身身体健康，子女事业有成；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）心态乐观向上，以自己的模范行为带动和影响自己子女，亲友和周围的人崇德向善。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）家庭成员遵纪守法，有良好的道德风尚，邻里关系和睦。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（六）参事之星 </span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（1）</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">自觉参加组织生活，在思想上、行动上与党中央和省、市委、医院党委保持高度一致。</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">（2）真心实意为医院改革发展</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">建言献策、参与支部管理，在支部管理与建设中发挥积极作用；</span><strong> </strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">（3）</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">积极乐观向上<strong>，</strong>保持党员先进本色，为稳定我院离退休干部队伍和谐稳定起着正面的积极作用。</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\">三、评选推荐的办法和要求:</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; color: rgb(81, 81, 81); font-family: 宋体, SimSun;\">1、评选推荐工作采取党员民主推荐、支委会评议的方式。此次表彰名额为每星2-3人</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; color: rgb(81, 81, 81); font-family: 宋体, SimSun;\">2、凡推荐表彰的“正能量之星”离退休干部党员，均要认真“正能量之星先进事迹”登记表。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\"> </span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\"></span></p><p style=\"line-height: 3em; text-indent: 2em; text-align: right;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\">盐城市第一人民医院老干部支部</span></p><p style=\"line-height: 3em; text-indent: 2em; text-align: right;\"><span style=\"font-size: 20px; color: rgb(81, 81, 81); font-family: 宋体, SimSun;\"> 二O一八年十二月九日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2188','3008','1','','','：我院离退休党员同志为深入推进我院离退休党员干部“进一步解放思想，激励新时代新担当新作为”学习教育活动，巩固大家一年来“两学一做”的学习成果，回顾党的历史，增强对党的事业的感情，进一步提高我院离退休党员干部的综合素质，经院领导同意，在建党97周年到来之','192.168.162.110','192.168.162.110','1530547200','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体; font-size: 20px;\">：我院离退休党员同志</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体; background: white;\">为深入推进我院离退休党员干部“进一步解放思想，激励新时代新担当新作为”学习教育活动，巩固大家一年来“两学一做”的学习成果</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体;\">，回顾党的历史，增强对党的事业的感情，</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体; background: white;\">进一步提高我院离退休党员干部的综合素质，</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体;\">经院领导同意，在建党97周年到来之际，决定在我院离退休党员中开展纪念建党周年知识竞赛活动。现将有关事项通知如下：</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">一、参赛人员</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">党组织关系在老干部支部的党员同志。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">二、竞赛时间</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 19px; font-family: 宋体;\">7月4日下午3：00—4：00。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><span style=\"font-size: 19px; font-family: 宋体; color: black; background: white;\">三、</span><strong><span style=\"font-size: 19px; font-family: 宋体;\">竞赛内容</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; color: black; background: white; font-size: 20px;\">以《中国共产党章程》、《中共党史》、习近平《新时代中国特色社会主义思想三十讲》等学习辅导材料内容为主。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">四、参赛方式</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 19px; font-family: 宋体;\">1、笔试题共25题，全部为选择题。集中学习时现场在试题答题。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">五、奖励办法</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">获奖奖项根据参赛者答题得分情况由高分到低分采取现场抽奖方式产生。竞赛设一、二、三等奖和纪念奖。其中一等奖2名，二等奖4名，三等奖6名，纪念奖若干。所有获奖人员都将获得相应的奖品。 </span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体; font-size: 20px;\">市一院老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体; font-size: 20px;\">二O一八年七月三日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2189','3009','1','','','：各位离退休老同志你们好！在院领导的关心下，在体检中心的各位同仁的大力支持下，我院定于3月19日－3月24日为全院离退休职工安排一次健康检查。每位离退休职工的体检表和体检时间我们都已安排好，请各位老同志本人于3月16日前到院离退休干部处领取（原则上本次体检表','192.168.162.110','192.168.162.110','1520870400','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休老同志</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">你们好！</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在院领导的关心下，在体检中心的各位同仁的大力支持下，我院定于3月19日－3月24日为全院离退休职工安排一次健康检查。每位离退休职工的体检表和体检时间我们都已安排好，请各位老同志本人于3月16日前到院离退休干部处领取（原则上本次体检表不得代领，确有特殊情况需请人代领的同志，请代领人持被领人的身份证），请各位严格按照规定时间去完成体检。组织关系在老干部支部的党员同志来领体检表的时候请一并将2018年度的党费交纳一下！</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">由于离退休职工人员较多，我们不再一一电话通知，凡看到通知的同志，敬请相互转告！谢谢！</span><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span></p><p style=\"line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">市一院离退休干部处</span></p><p style=\"line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年3月13日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2190','3010','1','','','：各位离退休老同志，你们好根据国家计生委副主任崔丽同志在全国“两会”期间卫生计生系统安全稳定工作讲话精神要求，院党委充分认识到卫生计生系统安全生产形势的严峻性，立即召开医院安全工作会议，院领导就医院安全、消防安全、后勤保障、信访稳定、卫生应急、应急值','192.168.162.110','192.168.162.110','1519833600','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休老同志，你们好</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px; text-indent: 2em;\">根据国家计生委副主任崔丽同志在全国“两会”期间卫生计生系统安全稳定工作讲话精神要求，院党委充分认识到卫生计生系统安全生产形势的严峻性，立即召开医院安全工作会议，院领导就医院安全、消防安全、后勤保障、信访稳定、卫生应急、应急值守和信息报送等方面工作做了具体的要求。广大离退休老同志虽然离开了工作岗位，但安全与每个人的切身利益密切相关，大家应时刻紧绷安全意识这根弦。请大家自觉做好自身家庭安全隐患的排查工作，保证家里的水、电、气的安全，严防火灾；节日里各种美食诱人，大家要注意食品安全，保护身体健康；走亲访友出行要遵守交通规则，注意阴雨天的交通安全；不扬言滋事或参与大规模的聚集活动，不参与违法越级上访活动，远离非法聚众闹事；不在公共场合或网络上发布反动言论。如发现安全隐患，请及时与医院领导或老干部支部主动联系，以确保两会期间我院离退休干部队伍的稳定。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">联系电话：13626200808 </span></p><p><br /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 市一院离退休干部处</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 二O一八年三月一日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2191','3011','1','','','根据《盐城市第一人民医院2021年上半年公开招聘编外护理专业技术人员》公告精神，经过报名、资格审查、笔试、面试、实践操作考核、体检、考察等环节，现将拟聘用人员名单面向社会公示。              一、盐城市第一人民医院护理A（','192.168.162.110','192.168.162.110','1627548228','<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"792\" style=\"border-collapse:\r\n  collapse;width:597pt\">\r\n  <colgroup><col width=\"55\" style=\"width:41pt\">\r\n  <col width=\"76\" style=\"width:57pt\">\r\n  <col width=\"74\" style=\"width:56pt\">\r\n  <col width=\"74\" span=\"5\" style=\"\r\n  width:56pt\">\r\n  <col width=\"67\" style=\"width:50pt\">\r\n  <col width=\"92\" style=\"width:69pt\">\r\n  <col width=\"58\" style=\"width:44pt\">\r\n  </colgroup>\r\n  <tbody>\r\n    <tr height=\"54\" style=\"height:41.1pt\">\r\n      <td style=\"padding-top:1px;padding-right:1px;padding-left:1px;color:black;font-size:11.0pt;font-weight:400;font-style:normal;text-decoration:none;font-family:宋体;text-align:general;vertical-align:middle;border:none;white-space:nowrap;font-size:12.0pt;text-align:left;white-space:normal;height:41.1pt;\r\n      width:597pt\" colspan=\"11\" height=\"54\" width=\"792\"><span>&nbsp;&nbsp;&nbsp;\r\n      </span>根据《盐城市第一人民医院2021年上半年公开招聘编外护理专业技术人员》公告精神，经过报名、资格审查、笔试、面试、实践操作考核、体检、考察等环节，现将拟聘用人员名单面向社会公示。</td>\r\n    </tr>\r\n    <tr height=\"33\" style=\"height:24.95pt\">\r\n      <td style=\"padding-top:1px;padding-right:1px;padding-left:1px;color:black;font-size:11.0pt;font-weight:400;font-style:normal;text-decoration:none;font-family:宋体;text-align:general;vertical-align:middle;border:none;white-space:nowrap;font-size:14.0pt;font-family:方正小标宋_GBK, cursive;text-align:left;white-space:normal;height:24.95pt;\r\n      width:597pt\" colspan=\"11\" height=\"33\" width=\"792\">一、盐城市第一人民医院护理A（岗位代码1），计15人。</td>\r\n    </tr>\r\n    <tr height=\"28\" style=\"height:21.0pt\">\r\n      <td style=\"padding-top:1px;padding-right:1px;padding-left:1px;color:black;font-size:11.0pt;font-weight:400;font-style:norma