INSERT INTO `p8_cms_item_article_addon` VALUES ('2230','3052','1','','','1、盐城市第一人民医院北区发热门诊值班室改造项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。2、项目概况与招标内容2.1项目名称：盐城市第一人民医院北区发热门诊值班室改造项目。2.2项目地点：盐城市第一人民医院北区','192.168.162.110','192.168.162.110','1628734234','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">1</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、盐城市第一人民医院北区发热门诊值班室改造项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">2</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、项目概况与招标内容</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">2.1</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">项目名称：盐城市第一人民医院北区发热门诊值班室改造项目。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">2.2</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">项目地点：盐城市第一人民医院北区</span><span style=\"font-family:宋体;background:white\">（毓龙西路<span>166</span>号）</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">2.3</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">招标内容：北区发热门诊医护人员值班室改造等项目。具体内容详见招标人提供的图纸及工程量清单。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">2.4</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">发包方式：包工包料。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">3</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、投标人资格要求</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;background:white\">投标人须具有有效的建筑装修装饰工程专业承包二级及以上施工资质的独立法人，并具有有效的安全生产许可证。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;\r\nbackground:white\">4</span><span style=\"font-family:宋体;color:black;background:\r\nwhite\">、投标报名及招标文件的获取</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:26.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;color:black;background:white\">请符合上述资质条件的投标人携带单位介绍信（或授权委托书，须注明联系人、电话及邮箱）原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名，投标