产企业、经营企业请于<span>2021</span>年<span>08</span>月<span> 21</span>日前将相关材料发送至邮箱：</span><span><a href=\"mailto:ycyysbc@qq.com。\"><span style=\"font-family:宋体\">ycyysbc@qq.com</span><span style=\"font-family:宋体\"><span>。</span></span></a></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">现场咨询会时间另行通知。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.1pt;line-height:30.0pt\"><strong><span style=\"font-family:宋体;color:#333333\">报名须知：</span></strong></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">1.</span><span style=\"font-family:宋体;color:#333333\">具有独立承担民事责任的能力。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">2.</span><span style=\"font-family:宋体;color:#333333\">具有履行合同所必须具备的设备和专业知识。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">3.</span><span style=\"font-family:宋体;color:#333333\">具有良好的商业信誉。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">4.</span><span style=\"font-family:宋体;color:#333333\">近<span>3</span>年内在经营活动中无严重不良记录。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">5.</span><span style=\"font-family:宋体;color:#333333\">按要求填写《盐城市第一人民医院设备咨询报名表》（见附件）。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:30.0pt\"><span style=\"font-family:宋体;color:#333333\">6.</span><span style=\"font-family:宋体;color:#333333\">报名截止时间：<span>2021</span>年<span>8</span>月<span>21</span>日<span>24</span>：<span>00</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;layout-grid-mode:char;font-size:11.0pt;font-family:\'Tahoma\',\'sans-serif\';text-indent:36.0pt;line-height:30.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;color:#333333\">联系人：李老师<span>&nbsp;\r\n</span>联系方式：<span>0515-88508946&nbsp; QQ:651830413(</span>推荐<span>)</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:0cm;layout-grid-mode:char;font-size:11.0pt;font-family:\'Tahoma\',\'sans-serif\';text-indent:36.0pt;line-height:30.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;color:#333333\"><span><img border=\"0\" src=\"/ewebeditor/sysimage/icon16/doc.gif\"><a href=\"/ewebeditor/uploadfile/file/2021/08/16/20210816164647876.docx\" target=\"_blank\">附件设备咨询报名表(1).docx</a><br>\r\n</span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2235','3057','1','','<!--#p8_attach#-->/cms/item/2021_08/20_14/6dc95d2fffa50b56.JPG.thumb.jpg','4月16日～18日，江苏省第三届泌尿系统结石高峰论坛暨2021年江苏省医学会泌尿外科学分会结石学组专题学术会议在盐城召开。','192.168.162.110','192.168.162.110','1618901940','<p><span style=\"\">4月16日～18日，江苏省第三届泌尿系统结石高峰论坛暨2021年江苏省医学会泌尿外科学分会结石学组专题学术会议在盐城召开。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2236','3058','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/e225afc8220dd3db.jpg.thumb.jpg','肺癌（肺结节）多学科联合诊疗（MDT）是综合肺癌患者各方面身体状况和客观条件，依循证医学理念多学科合作为患者提供合理的、规范的、个性化治疗方案。','192.168.162.110','192.168.162.110','1618902140','<p><span style=\"\">肺癌（肺结节）多学科联合诊疗（MDT）是综合肺癌患者各方面身体状况和客观条件，依循证医学理念多学科合作为患者提供合理的、规范的、个性化治疗方案。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2237','3059','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/25f24f65b7b2d268.jpg.thumb.jpg','近日，盐城市第一人民医院神经外科郭俊专家团队为一名颈椎管内肿瘤患者实施了微创切除肿瘤手术。','192.168.162.110','192.168.162.110','1619247900','<p><span style=\"orphans: 2; text-align: justify; text-indent: 0px; widows: 2; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important; font-size: 16pt;\">近日，盐城市第一人民医院神经外科郭俊专家团队为一名颈椎管内肿瘤患者实施了微创切除肿瘤手术。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2238','3060','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/6338116a5a71a85e.JPG.thumb.jpg','为营造风清气正、干事创业的良好政治生态，推进医院党建和党风廉政建设工作向纵深发展，4月22日下午，盐城市第一人民医院召开2021年党建、党风廉政建设暨意识形态工作会议。','192.168.162.110','192.168.162.110','1619248357','<p><span style=\"\">为营造风清气正、干事创业的良好政治生态，推进医院党建和党风廉政建设工作向纵深发展，4月22日下午，盐城市第一人民医院召开2021年党建、党风廉政建设暨意识形态工作会议。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2239','3061','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/1a8d096aecc91a3c.jpg.thumb.jpg','由盐城市医学会主办、盐城市第一人民医院消化内科承办的盐城市医学会消化内镜学分会成立大会、消化内镜规范化诊疗及新技术研讨会、盐城市第一人民医院消化专科联盟学术交流会，于5月8日~9日在盐城迎宾馆隆重召开。','192.168.162.110','192.168.162.110','1620717257','<p><span style=\"\">由盐城市医学会主办、盐城市第一人民医院消化内科承办的盐城市医学会消化内镜学分会成立大会、消化内镜规范化诊疗及新技术研讨会、盐城市第一人民医院消化专科联盟学术交流会，于5月8日~9日在盐城迎宾馆隆重召开。</span></p>','','','','','');
