INSERT INTO `p8_cms_item_article_addon` VALUES ('2241','3063','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/83cace1338770cb3.jpg.thumb.jpg','在六一儿童节即将到来之际，5月18日，盐城市第一人民医院儿童医院支部、机关一支部、医技二支部、门诊支部等四个党支部组建党员志愿服务队，赴盐城市儿童福利院为41名“小天使”开展健康检查、康复治疗、心理援助、健康宣教等服务。','192.168.162.110','192.168.162.110','1621408604','<p><span style=\"\">在六一儿童节即将到来之际，5月18日，盐城市第一人民医院儿童医院支部、机关一支部、医技二支部、门诊支部等四个党支部组建党员志愿服务队，赴盐城市儿童福利院为41名“小天使”开展健康检查、康复治疗、心理援助、健康宣教等服务。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2242','3064','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/c0bc11e168291a08.jpg.thumb.jpg','为提升儿童医院知名度、影响力，进一步提高儿童健康意识，6月1日，盐城市儿童医院精心策划系列活动，庆祝六一儿童节和一周岁生日。','192.168.162.110','192.168.162.110','1622531872','<p><span style=\"\">为提升儿童医院知名度、影响力，进一步提高儿童健康意识，6月1日，盐城市儿童医院精心策划系列活动，庆祝六一儿童节和一周岁生日。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2243','3065','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/0e16899f5a7dde32.jpg.thumb.jpg','对于肿瘤性疾病，多学科综合治疗协作组模式（MDT）是有效的手段。MDT以患者为中心，组成专家包括胃肠外科、肝胆外科、肿瘤内科、放疗科、介入科、放射和影像科、病理科等相关专业具有一定资质的医生。','192.168.162.110','192.168.162.110','1623309553','<p><span style=\"\">对于肿瘤性疾病，多学科综合治疗协作组模式（MDT）是有效的手段。MDT以患者为中心，组成专家包括胃肠外科、肝胆外科、肿瘤内科、放疗科、介入科、放射和影像科、病理科等相关专业具有一定资质的医生。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2244','3066','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/bfe27ee388d7c542.JPG.thumb.jpg','为进一步打造开放共享的医疗科研交流合作平台，加快普及百姓迫切所需的诊疗技术，6月28日上午，南京大学医学院盐城医学研究中心暨盐城市第一人民医院中心实验室揭牌成立！','192.168.162.110','192.168.162.110','1624951267','<p><span style=\"\">为进一步打造开放共享的医疗科研交流合作平台，加快普及百姓迫切所需的诊疗技术，6月28日上午，南京大学医学院盐城医学研究中心暨盐城市第一人民医院中心实验室揭牌成立！</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2245','3067','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/3b38c22d0f41363b.jpg.thumb.jpg','为更好地满足人民群众多样化、多层次的健康需求，尤其是为刚出院康复期患者、高龄或失能患者、孕产妇、残疾人以及其他有居家护理需求的特殊人群提供院内、院外同质化的优质护理服务，提高护理普及性和亲民性，盐城市第一人民医院“互联网+护理服务”项目，经过前期积极的筹备和试运行，现已正式上线！','192.168.162.110','192.168.162.110','1625124126','<p><span style=\"orphans: 2; text-align: justify; text-indent: 0px; widows: 2; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important; font-size: 16pt;\">为更好地满足人民群众多样化、多层次的健康需求，尤其是为刚出院康复期患者、高龄或失能患者、孕产妇、残疾人以及其他有居家护理需求的特殊人群提供院内、院外同质化的优质护理服务，提高护理普及性和亲民性，盐城市第一人民医院“互联网+护理服务”项目，经过前期积极的筹备和试运行，现已正式上线！</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2246','3068','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/a6f282136e381653.jpg.thumb.jpg','7月1日，盐城市第一人民医院召开党员代表大会，隆重庆祝中国共产党成立100周年。','192.168.162.110','192.168.162.110','1625124256','<p><span style=\"orphans: 2; text-align: justify; text-indent: 0px; widows: 2; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important; font-size: 16pt;\">7月1日，盐城市第一人民医院召开党员代表大会，隆重庆祝中国共产党成立100周年。</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2247','3069','1','','<!--#p8_attach#-->/cms/item/2021_08/20_15/3b857ce20d3558ea.jpg.thumb.jpg','勇担医者使命，守护人民健康！','192.168.162.110','192.168.162.110','1629357955','<p>勇担医者使命，守护人民健康！</p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2248','3070','1','','','因医院实际工作需要，于2021年8月19日进行招标的项目，经评标小组评审，中标结果如下：一、盐城市第一人民医院北区发热门诊值班室改造项目中标单位：江苏亮辉建设工程有限公司中标价：4.6255万元二、盐城市第一人民医院北区9、10号楼消火栓地埋管道更换项目中标单位：九','192.168.162.110','192.168.162.110','1629680768','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">因医院实际工作需要，于<span>2021</span>年<span>8</span>月<span>19</span>日进行招标的项目，经评标小组评审，中标结果如下：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:28.0pt\"><b><span style=\"font-family:宋体;color:#333333\">一、盐城市第一人民医院北区发热门诊值班室改造项目</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标单位：江苏亮辉建设工程有限公司</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标价：<span>4.6255</span>万元</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:28.0pt\"><b><span style=\"font-family:宋体;color:#333333\">二、盐城市第一人民医院北区<span>9</span>、<span>10</span>号楼消火栓地埋管道更换项目</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标单位：九州永泰建设工程江苏有限公司</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标价：<span>23.114234</span>万元</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:28.0pt\"><b><span style=\"font-family:宋体;color:#333333\">三、盐城市第一人民医院主院区智能停车场管理系统改造及维保项目</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标单位：厦门科拓通讯科技股份有限公司</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:10.0pt;line-height:1.5;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">中标价：<span>7.8</span>万元</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:\r\n宋体;color:#333333\">为体现公开、公平、公正的原则，特此公告三天。如有疑问请与盐城市第一人民医院监督审查室联系，电话<span>0515-66696810</span>。<span>&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:28.0pt\"><span style=\"font-family:宋体;color:#333333\">&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:right;\r\ntext-indent:24.0pt;line-height:28.0pt\" align=\"right\"><span style=\"font-family:宋体;color:#333333\">盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:right;\r\ntext-indent:24.0pt;line-height:28.0pt\" align=\"right\"><span style=\"font-family:\r\n宋体;color:#333333\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2021</span><span style=\"font-family:\r\n宋体;color:#333333\">年<span>8</span>月<span>23</span>日</span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2249','3071','1','','','盐城市第一人民医院室内绿化招租及主院区绿化养护服务项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。1、项目概况1.1 项目名称：盐城市第一人民医院室内绿化招租及主院区绿化养护服务；1.2项目地点：盐城市第一人民医院','192.168.162.110','192.168.162.110','1629686422','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">盐城市第一人民医院室内绿化招租及主院区绿化养护服务项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、项目概况</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.1 </span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">项目名称：盐城市第一人民医院室内绿化招租及主院区绿化养护服务；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.2</span><span style=\"font-size:12.0pt;font-family:宋体\">项目地点：盐城市第一人民医院主院区、北区、五官科医院、紫薇门诊及皮肤科专科医院、盐城市儿童医院；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:21.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3</span><span style=\"font-size:12.0pt;font-family:宋体\">招标内容：盐城市第一人民医院主院区室内绿化招租及绿化养护服务，招标人保留调整招标范围的权力，中标人须无条件服从。主要内容如下：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3.1</span><span style=\"font-size:12.0pt;font-family:宋体\">室内绿化招租</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>1</span>）室内绿化招租范围：盐城市第一人民医院主院区、北区、五官科医院、紫薇门诊及皮肤科专科医院、盐城市儿童医院；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>2</span>）负责对摆放盆栽的运输、搬运、更换、日常养护及前期施工绿化景观养护等工作；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>3</span>）采购的各类盆栽应枝叶茂盛、修剪整齐；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:25.0pt\"><b><span style=\"font-size:12.0pt;font-family:宋体\">（<span>4</span>）应根据招标人的要求、不同季节及植物的生长特性对盆栽及时更换；</span></b><span style=\"font-size:12.0pt;font-family:宋体\">招标人认为盆栽不合格的，中标人须立即更换；更换期限为<span>24</span>小时，逾期一天每盆扣<span>50</span>元，依此类推；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>5</span>）所摆放的盆栽、绿化景观均由中标人派人员养护（含浇水、修建、整理），养护人员发生的一切问题和责任与招标人无关，相关的一切费用或民事、刑事责任均由中标人自行承担；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>6</span>）招标人如需临时在全院内增加盆栽（花），中标人须在<span>3</span>日内准备到位，经院方确认后按中标单价按实结算。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3.2</span><span style=\"font-size:12.0pt;font-family:宋体\">绿化养护</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">室内绿化招租范围：盐城市第一人民医院主院区；绿化养护工作分为基本工作项目和定期工作项目等两部分。基本工作指一般性正常维护，即浇水、清理垃圾及零星病虫害防治、除杂草、清除病树、枯枝等；定期工作指每季度全面修建整形、施肥、除杂草、松土、全面病虫害防治及防寒涂白工作。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:36.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">工作要求：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>1</span>）草坪高度应保持在<span>10-15cm</span>以内，每年修剪必须不少于<span>6</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>2</span>）应对所有绿地进行彻底连根除草，消灭杂草乱生的现象，禁止喷洒除草药剂，每年除草必须不少于<span>5</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>3</span>）树木修剪包含乔木和灌木的整形修剪、抹芽、清理徒长枝、枯枝、病枝等，每年不少于<span>6</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>4</span>）应结合天气情况，每年<span>1-4</span>月份，如出现干旱，每月应至少浇水一次；每年<span>5-10</span>月份，应根据气温变化及时浇水，做好抗高温和抗旱工作；并在雨季期间做好排水措施；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>5</span>）在春季、秋季期间，对所有绿化全面施肥至少<span>2</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>6</span>）病虫害防治工作应预防为主，要及时发现并立即处理病虫害；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>7</span>）针对超低温天气，须对特殊树木（如香樟）采取防寒措施； </span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>8</span>）对主次干道行道树在每年秋季涂白一次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>9</span>）绿化养护作业时，不得影响医院正常的医疗秩序。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">具体详见招标人的要求和工程量清单。<b>招标人保留调整</b></span><b><span style=\"font-size:12.0pt;font-family:宋体\">绿化种类的权利，中标人须无条件服从。</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.4</span><span style=\"font-size:12.0pt;font-family:宋体\">服务期：<span> 3 </span>年，</span><span style=\"font-size:12.0pt;font-family:宋体\">合同按年签订。经招标人年度考核合格后，可续签下一年合同；考核不合格的，招标人</span><span style=\"font-size:12.0pt;font-family:宋体\">有权立即终止合同。</span><span style=\"font-size:\r\n12.0pt;font-family:宋体\">具体开始日期以招标人的书面通知为准。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2 </span></b><b><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.1</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须是具有有效的含园林绿化经营范围的企业营业执照的独立法人。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.2</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须具备自营苗木花场场所并提供相关证明材料。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">3</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>23</span>日<span>8</span>时<span>30</span>分至<span>2021</span>年<span>8</span>月<span>27</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">4</span><span style=\"font-family:宋体;background:white\">、本项目采用“综合评估法”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">5</span><span style=\"font-family:宋体;background:white\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">6</span><span style=\"font-family:宋体;background:white\">、招投标监督管理机构及投诉电话：盐城市第一人民医院纪检监察室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">其余内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp; </span><span style=\"font-family:宋体;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white;word-break:break-all\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-family:宋体;background:white\">时间：<span>2021</span>年<span>8</span>月<span>23</span>日<span>&nbsp; </span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2250','3072','1','','','盐城市第一人民医院主院区病房电视信号接入服务资金已落实，我院现拟对该项目进行公开招标，诚邀潜在的投标人参加投标，择优选择施工队伍。1、项目概况1.1 项目名称：盐城市第一人民医院主院区病房电视信号接入服务项目。1.2 服务地点：盐城市第一人民医院主院区（人民','192.168.162.110','192.168.162.110','1629686457','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">盐城市第一人民医院主院区病房电视信号接入服务资金已落实，我院现拟对该项目进行公开招标，诚邀潜在的投标人参加投标，择优选择施工队伍。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">1</span></b><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">、项目概况</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.1 </span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">项目名称：</span><span style=\"font-size:12.0pt;font-family:宋体\">盐城市第一人民医院</span><span style=\"font-size:12.0pt;font-family:宋体\">主院区病房电视信号接入服务</span><span style=\"font-size:12.0pt;font-family:宋体\">项目</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.2 </span><span style=\"font-size:12.0pt;font-family:宋体;color:windowtext\">服务地点</span><span style=\"font-size:12.0pt;font-family:宋体\">：</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;background:white\">盐城市第一人民医院主院区</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext;background:white\">（人民南路<span>66</span>号）</span><span style=\"font-size:12.0pt;font-family:宋体;color:windowtext\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">1.3</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">招标内容：主盐城市第一人民医院主院区病房电视信号接入服务，确保医院内所有病房电视能收到信号，正常收看。<b>招标人仅提供电视机，不提供其他任何设备，投标人须自行勘察现场，了解现场具体情况，配备必要的设备及线路等。</b>信号源服务须至少提供<span>11</span>各电视信号频道和<span>5</span>个自建媒体播放频道，共计不少于<span>16</span>个电视频道。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.4</span></b><b><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">服务期：<span> 3 </span>年，</span></b><b><span style=\"font-size:12.0pt;font-family:宋体\">合同按年签订，经采购人年度考核合格后，可续签下一年合同。具体开始日期以招标人的书面通知为准。</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.5</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">发包方式：包工包料</span><span style=\"font-size:12.0pt;font-family:宋体\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">2 </span></b><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.1</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须是具有《中华人民共和国基础电信业务经营许可证》的网络运营商的本地授权分支机构，或经营范围内含有“广播电视传输网络建设、改造、经营、维护和管理”的网络运营商的本地授权分支机构。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">3</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>23</span>日<span>8</span>时<span>30</span>分至<span>2021</span>年<span>8</span>月<span>27</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">4</span><span style=\"font-family:宋体;background:white\">、本项目采用“综合评估法”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">5</span><span style=\"font-family:宋体;background:white\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">6</span><span style=\"font-family:宋体;background:white\">、招投标监督管理机构及投诉电话：盐城市第一人民医院纪检监察室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">其余内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp; </span><span style=\"font-family:宋体;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white;word-break:break-all\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-family:宋体;background:white\">时间：<span>2021</span>年<span>8</span>月<span>23</span>日<span>&nbsp; </span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` VALUES ('2251','3073','1','','','因疫情防控工作需要，盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目根据财办库【2020】23号《财政部办公厅关于疫情防控采购便利化的通知》文件，采用“绿色通道”进行便利化采购。现通过公开招标方式邀请潜在投标人参加本项目的投标，现就有关事项','192.168.162.110','192.168.162.110','1629706236','<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt;layout-grid-mode:\r\nchar\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">因疫情防控工作需要，盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目根据财办库【<span>2020</span>】<span>23</span>号《财政部办公厅关于疫情防控采购便利化的通知》文件，采用“绿色通道”进行便利化采购。现通过公开招标方式邀请潜在投标人参加本项目的投标，现就有关事项公告如下：</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">一、项目基本情况</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">项目名称：盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">采购方式：公开招标 </span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">预算金额：<span>90</span>万元；最高限价：<span>90</span>万元。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">采购需求：盐城市第一人民医院（主院区）救护车消洗中心设备采购及伴随服务项目，包含但不限于车辆外部洗消系统、救护车内消毒系统、空间消毒系统、壁挂式等离子空气消毒机、智能衣服消毒柜等设备采购、安装及调试、洗消中心配套用房建设等相关伴随服务，具体内容详见招标文件中“项目需求”的约定。共设一个标段。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">合同履行期限：合同签订后<span>10</span>日历天内完成设备的供货、安装、调试、售前等相关伴随服务。具体交货期或交付使用期、开工日期以采购人发出开工令为准（期间材料风险由中标人充分考虑）。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">二、申请人的资格要求：</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.</span><span style=\"font-size:12.0pt;font-family:宋体\">满足《中华人民共和国政府采购法》第二十二条规定，并提供下列材料；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">(1)</span><span style=\"font-size:12.0pt;font-family:宋体\">法人或者其他组织的营业执照等证明文件，自然人的身份证明；<span><br>\r\n</span>　<span>&nbsp; (2)</span>上一年度的财务报表（成立不满一年不需提供）；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">(3)</span><span style=\"font-size:12.0pt;font-family:宋体\">依法缴纳税收和社会保障资金的相关材料；<span><br>\r\n</span>　　<span>(4)</span>具备履行合同所必需的设备和专业技术能力的书面声明；<span><br>\r\n</span>　<span>&nbsp; (5)</span>参加政府采购活动前<span>3</span>年内在经营活动中没有重大违法记录的书面声明；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">2.</span><span style=\"font-size:\r\n12.0pt;font-family:宋体\">落实政府采购政策需满足的资格要求：无</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">3.</span><span style=\"font-size:12.0pt;font-family:宋体\">本项目的特定资格要求：</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>1</span>）未被“信用中国”网站（<span>www.creditchina.gov.cn</span>）列入失信被执行人、重大税收违法案件当事人名单、政府采购严重失信行为记录名单。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>2</span>）单位负责人为同一人或者存在直接控股、管理关系的不同供应商，不得参加同一合同项下的政府采购活动。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>3</span>）本项目不接受联合体。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体;font-weight:\r\nnormal\">三、获取采购文件</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt;background:white\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>23</span>日<span>8</span>时<span>30</span>分</span><span style=\"font-size:12.0pt;font-family:宋体\">至<span>2021</span>年<span>8</span>月<span>27</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13625222261</span>。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">四、响应文件提交</span></h2>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">响应文件提交截止时间：</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">2021</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">年</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">8</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">月</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">28</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">日上午</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">9</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">：</span><span style=\"font-size:12.0pt;font-family:宋体;font-weight:normal\">30</span><span style=\"font-size:12.0pt;font-family:幼圆;font-weight:normal\">时；</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">响应文件提交</span><span style=\"font-size:12.0pt;font-family:宋体\">地点：盐城市第一人民主院区门诊四楼会议室<span>(</span>人民南路<span>66</span>号）</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">五、</span><span style=\"font-size:12.0pt;font-family:宋体\">响应文件开启信息</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">响应文件开启时间：<span>2021</span>年<span>8</span>月<span>28</span>日上午<span>9</span>：<span>30</span>时；</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt\" align=\"left\"><span style=\"font-size:12.0pt;font-family:宋体\">响应文件开启地点：</span><span style=\"font-size:12.0pt;font-family:宋体\">盐城市第一人民主院区门诊四楼会议室<span>(</span>人民南路<span>66</span>号）</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;font-weight:normal\">六、其他补充事宜</span></h2>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">响应文件正本<span>1</span>份，副本<span> 3</span>份。</span></p>\r\n<h2 style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;fon